INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','','Nasze zasady i warunki dostawy','conditions, delivery, delay, shipment, pack','<p><strong>Przesyłki i zwroty</strong></p>\n<p><strong>Twoja przesyłka paczki</strong></p>\n<p><strong>Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem firmy UPS z opcją śledzenia i nadania bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jaką wysyłkę wybierzesz, udostępnimy Ci link do śledzenia przesyłki online.</strong></p>\n<p></p>\n<p><strong>Opłaty za wysyłkę obejmują opłaty manipulacyjne i pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Radzimy grupować przedmioty w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja przesyłka zostanie wysłana na własne ryzyko, ale dokładamy szczególnej staranności, aby chronić delikatne przedmioty.</strong></p>\n<p></p>\n<p><strong>Pudełka są odpowiednio duże, a Twoje przedmioty są dobrze chronione.</strong></p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','notice, legal, credits','<h2>Nota prawna</h2>\n<h2>Koncepcja i produkcja:</h2>\n<h2>Ta witryna internetowa została stworzona przy użyciu oprogramowania open-source PrestaShop™.</h2>','nota-prawna'),(3,1,1,'Warunki i zasady korzystania','','Nasze zasady i warunki korzystania','conditions, terms, use, sell','<h2>Twoje warunki użytkowania</h2>\n<h2>Zasada nr 1</h2>\n<h2>Oto treść zasady 1</h2>\n<h2></h2>\n<h2>Zasada 2</h2>\n<h2>Oto treść zasady 2</h2>\n<h2></h2>\n<h2>Zasada 3</h2>\n<h2>Oto treść zasady 3</h2>','warunki-i-zasady-korzystania'),(4,1,1,'O nas','','O nas','about us, informations','<h2>O nas</h2>\n<h2>Nasza firma</h2>\n<h2>Nasza firma</h2>\n<h2></h2>\n<h2>Nasz zespół</h2>\n<h2>Nasz zespół</h2>\n<h2></h2>\n<h2>Informacje</h2>\n<h2>Informacje</h2>','o-nas'),(5,1,1,'bezpieczna platnosc','','bezpieczna platnosc','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczna płatność</h2>\n<h2>Nasza bezpieczna płatność</h2>\n<h2>Z SSL</h2>','bezpieczna-platnosc');
