INSERT INTO `ps_homeslider_slides_lang` VALUES (1,1,'','<h2 style=\"font-family:dinpro;line-height:1.1em;font-size:3rem;margin-top:0px;margin-bottom:7px;color:#a79f93;letter-spacing:.28px;background-color:#181a1b;\">Dlaczego lampyiswiatlo.pl?</h2>\n<p style=\"margin-top:0px;margin-bottom:10px;color:#a79f93;font-family:dinpro;font-size:14px;font-weight:400;letter-spacing:.28px;background-color:#181a1b;\">Lampyiswiatlo.pl to lider w internetowej sprzedaży lampy i oświetlenie. Posiadamy bogaty asortyment produktów oświetleniowych na każdą kieszeń w tym również oświetlenie ogrodowe. Gwarantujemy, że prezentowane na stronie lampy są dostępne w naszym magazynie, dzięki czemu szybko zostaną do Ciebie dostarczone.</p>','sample-1','http://www.prestashop.com/?utm_source=back-office&utm_medium=v17_homeslider&utm_campaign=back-office-PL&utm_content=download','af45f7b39828e0a4294c6439449989eb215816d6_LENL_Categoriebanner_Buitenlampen_90784 (Custom).png'),(2,1,'','<h2 style=\"font-family:dinpro;line-height:1.1em;font-size:3rem;margin-top:0px;margin-bottom:7px;color:#a79f93;letter-spacing:.28px;background-color:#181a1b;\">Źródła światła</h2>\n<p style=\"margin-top:0px;margin-bottom:10px;color:#a79f93;font-family:dinpro;font-size:14px;font-weight:400;letter-spacing:.28px;background-color:#181a1b;\">Na lampyiswiatlo.pl dostępne są źródła światła niedrogie i energooszczędne. Oświetlenie pokoju w dużej mierze zależy od odpowiednio dobranej żarówki. W salonie i sypialni polecamy żarówki o niskiej intensywności, które nadadzą odpowiednią, przytulną atmosferę. Kuchnia czy miejsce pracy musi być z kolei bardzo dobrze oświetlone.</p>','','http://www.prestashop.com/?utm_source=back-office&utm_medium=v17_homeslider&utm_campaign=back-office-PL&utm_content=download','34bd818b16c257f311b43d08c8457b3ef34396ee_LENL_Categoriebanners_Binnenverlichting__93702_1 (Custom).jpeg'),(3,1,'','<h2 style=\"font-family:dinpro;line-height:1.1em;font-size:3rem;margin-top:0px;margin-bottom:7px;color:#a79f93;letter-spacing:.28px;background-color:#181a1b;\">Zakup oświetlenie jest prosty</h2>\n<p style=\"margin-top:0px;margin-bottom:10px;color:#a79f93;font-family:dinpro;font-size:14px;font-weight:400;letter-spacing:.28px;background-color:#181a1b;\">Tylko na lampyiswiatlo.pl znajdziesz unikatowe lampy w najniższych cenach. Możesz wybrać spośród kilku rodzajów płatności, a my gwarantujemy, że są one w 100% bezpieczne.</p>','','http://www.prestashop.com/?utm_source=back-office&utm_medium=v17_homeslider&utm_campaign=back-office-PL&utm_content=download','2b2c9c99c1d037eb5ffe62069a9fe13d4fbd3c17_LENL_Categoriebanners_Lichtbronnen (Custom).jpeg');
/*!40000 ALTER TABLE `ps_homeslider_slides_lang` ENABLE KEYS */;
