INSERT INTO `ps_info_lang` VALUES (1,1,1,'<h2 style=\"font-family:dinpro;line-height:1.1em;font-size:3rem;margin-top:0px;margin-bottom:7px;color:#a79f93;letter-spacing:.28px;background-color:#181a1b;\">Dlaczego lampyiswiatlo.pl?</h2>\n<p style=\"margin-top:0px;margin-bottom:10px;color:#a79f93;font-family:dinpro;font-size:14px;font-weight:400;letter-spacing:.28px;background-color:#181a1b;\">Lampyiswiatlo.pl to lider w internetowej sprzedaży lampy i oświetlenie. Posiadamy bogaty asortyment produktów oświetleniowych na każdą kieszeń w tym również oświetlenie ogrodowe. Gwarantujemy, że prezentowane na stronie lampy są dostępne w naszym magazynie, dzięki czemu szybko zostaną do Ciebie dostarczone. Zamówienia powyżej 300 zł są dostarczane bezpłatnie. Jeśli zamówienie zostanie złożone przed 22.00 to zostanie wysłane tego samego dania. Z kolei jeśli lampa bądź inny produkt nie spełnią Twoich oczekiwań możesz dokonać bezpłatnego zwrotu w ciągu 30 dni.</p>\n<p style=\"margin-top:0px;margin-bottom:10px;color:#a79f93;font-family:dinpro;font-size:14px;font-weight:400;letter-spacing:.28px;background-color:#181a1b;\">Nieważne czy wiesz dokładnie jaką lampę chcesz kupić czy tylko poszukujesz inspiracji. Na lampyiswiatlo.pl gwarantujemy i jedno i drugie!</p>');
/*!40000 ALTER TABLE `ps_info_lang` ENABLE KEYS */;
UNLOCK TABLES;

