INSERT INTO `ps_product_lang` VALUES (1,1,1,'Ładny, przewiewny design z mocnym minimalistycznym wizerunkiem. Czy również wybierasz ten stylowy wygląd? Ta lampa wisząca Cage jest fajna i nowoczesna. Czyste linie stanowią mocne stwierdzenie. Czarny kolor sprawia, że pasuje do każdego wnętrza. Ta klatka jest wyjątkowa ze względu na otwarty stojak, który znajduje się na górze lampy. Tutaj możesz bardzo łatwo coś ustawić. To sprawia, że ta lampa jest bardzo ładna nad stołem w jadalni, na przykład z wiszącymi na niej roślinami lub nad wyspą kuchenną z ziołami i tym podobnymi. Wybór należy do Ciebie! Ta klatka ma 101,5 cm długości, 41 cm wysokości, 20 cm szerokości i posiada 4 punkty świetlne. Lampa jest regulowana w zakresie od minimum 75 cm do maksymalnie 150 cm. Kabel ma długość 112 cm. Otwarty charakter projektu jest idealny do wykorzystania jednego z naszych pięknych dekoracyjnych źródeł światła E27 (maks. 60 W). Upewnij się, że kupujesz źródła światła z możliwością ściemniania lub źródła światła o małym strumieniu światła. Ze względu na 4 punkty świetlne lampa daje dużo światła. Wyznaczaj trendy i wyprzedzaj resztę dzięki tej fajnej i nowoczesnej klatce. * Uwaga: maksymalna waga klatki zależy od wytrzymałości sufitu! Dobrze, jeśli wcześniej to sprawdzisz.','','przemyslowa-lampa-wiszaca-czarna-ze-stelazem-4-punktowa-cage-rack','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Przemysłowa lampa wisząca czarna ze stelażem 4-punktowa - Cage Rack','W magazynie','Dostępny','',''),(2,1,1,'Bardzo elegancka nowoczesna lampa wisząca w połączeniu z czarną stalą z pięknie ukształtowanym szkłem i czterema bardzo mocnymi niewymiennymi modułami LED (1280 lumenów i 3000 kelwinów). Szkło ma matową środkową część i wygląda to bardzo luksusowo. Lampa idealnie wpasowuje się nad stołem w salonie lub kuchni. Lampa ma długość 120 cm i szerokość 6 cm. Płyta montażowa ma długość 27 cm i szerokość 6 cm. Możesz samodzielnie ustawić lampę w wysokości od minimum 80 cm do maksymalnie 150 cm. Uwaga; tej lampy nie można przyciemniać. Platinum to naprawdę zdjęcie do zobaczenia!','','designerska-lampa-wiszaca-czarna-z-diodami-led-platinum','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerska lampa wisząca czarna z diodami LED - Platinum','W magazynie','Dostępny','',''),(3,1,1,'Lampa wisząca Kasbah wprowadzi iście królewską atmosferę do Twojego domu. \n\nLampa inspirowana jest stylem art deco. Konstrukcja lampy w połączeniu z kryształkami nadaje lampie klasy. A same kryształy pięknie odbijają światło tworząc przecudowną atmosferę w pomieszczeniu.\n\nŚrednica klosza: 65 cm\n\nWysokość klosza: 75 cm\n\nRegulowana wysokość w zakresie: 80-190 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 3x40W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 3 gwinty na E27. \n\nLampa Kasbah będzie prawdziwą ozdobą salonu, sypialni czy jadalni.','','lampa-wiszaca-art-deco-krysztal-zlota-65cm-kasbah','Meta description-Kula','Meta keywords-Kula','Meta title-Kula','Lampa wisząca art deco kryształ złota 65cm - Kasbah','W magazynie','Dostępny','',''),(4,1,1,'Wire Dos to piękna duża lampa wisząca do przedpokoju, salonu lub jadalni. Jej pionowe słupki zapewniają piękny efekt świetlny w pomieszczeniu. Lampa wisząca wykonana jest ze stali i wykończona w kolorze czarnym. Dzięki temu jest ponadczasowy i pasuje do każdego wnętrza. Wire Dos ma średnicę 70 cm i ma regulowaną wysokość: minimum 114 cm i maksimum 204 cm. Płyta montażowa ma średnicę 12 cm i wysokość 4 cm. Sznurek ma długość 120 cm. Czarny klosz ma średnicę 70 cm i wysokość 80 cm. Uzupełnij lampę wiszącą o źródło światła z oprawą E27 (maks. 40 Watt). Wybierz źródło światła, które również ładnie wygląda, ponieważ jest wyraźnie widoczne w oprawie. Aby było jeszcze przytulniej, możesz przyciemnić lampę zewnętrznym ściemniaczem (brak w zestawie)','','designerska-lampa-wiszaca-czarna-70-cm-wire-dos','Meta description-Kula','Meta keywords-Kula','Meta title-Kula','Designerska lampa wisząca czarna 70 cm - Wire Dos','W magazynie','Dostępny','',''),(5,1,1,'Wow, jaką piękną lampą jest Wire Dos! Tej lampy wiszącej nie powinno zabraknąć w Twoim designerskim wnętrzu. Listwy przebijające światło pionowo tworzą piękny efekt świetlny w pomieszczeniu. Lampa wisząca wykonana jest ze stali i wykończona w kolorze złotym. Ma średnicę 70 cm i jest regulowana na wysokość; minimum 114 cm i maksimum 204 cm. Płyta montażowa ma średnicę 12 cm i wysokość 4 cm. Sznurek ma długość 120 cm. Stalowy klosz ma średnicę 70 cm i wysokość 80 cm. Zakończ Wire Dos źródłem światła z oprawą E27 (maks. 40 Watt). Nie zapomnij zamówić ich osobno. Aby w domu było jeszcze przytulniej, lampę można podłączyć do ściemniacza, którego nie ma w zestawie. Piękna lampa wisząca nad stołem jadalnym, w salonie lub sypialni. Uzupełnij swoje designerskie wnętrze lampą wiszącą Wire Dos.','','designerska-lampa-wiszaca-zlota-70-cm-wire-dos','Meta description-Kula','Meta keywords-Kula','Meta title-Kula','Designerska lampa wisząca złota 70 cm - Wire Dos','W magazynie','Dostępny','',''),(6,1,1,'Lampa wisząca Magna Classic będzie nie tylko praktycznym dodatkiem emitującymi nastrojowe światło, ale również ozdobą każdego pomieszczenia.\n \nPrzecierane wnętrze klosza sprawia, że emitowane światło jest ciepłe i nastrojowe.\n \nŚrednica klosza: 34 cm\n \nWysokość klosza: 22 cm\n \nŚrednica podsufitki: 9 cm\n \nCałkowita wysokość lampy: 85 cm (długość zawieszenia można skrócić)\n \nLampa jest gotowa do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy do 40W. \n \nKolekcja Magna to synonim powabu i szyku.','','przemyslowa-lampa-wiszaca-braz-35cm-magna-classic','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Przemysłowa lampa wisząca brąz 35cm - Magna Classic','W magazynie','Dostępny','',''),(7,1,1,'Cóż za przytulna lampa wisząca Kiko! 5 punktów świetlnych wygląda jak świece zwisające z oprawy. Lampa wisząca wykonana jest z aluminium i wykończona w kolorze czarnym ze złotem. Ma długość 98 cm i szerokość 8 cm. Posiada regulację wysokości od 38,5 cm do 155 cm. Sznur ma długość 146,5 cm. Płyta montażowa ma wysokość 4 cm, długość 34 cm i szerokość 8 cm. Każda ze złotych czapek ma średnicę 4 cm i wysokość 4,5 cm. Dioda LED jest zintegrowana z oprawą i ma strumień świetlny 2000 lumenów i 2700 kelwinów. Daje to lampie wiszącej dużo bardzo ciepłego, białego światła. Dioda LED można również ściemniać za pomocą 3-stopniowego ściemniacza. Oznacza to, że po naciśnięciu własnego przełącznika światła, gdy uzyskasz 100% (pełnego) światła, a po raz drugi 60% światła. Za trzecim razem masz 30% (atmosferycznego) światła. Kiko to idealna lampa wisząca nad stołem w jadalni lub w biurze. Nadaj swojemu wnętrzu klimat dzięki lampie wiszącej Kiko!','','nowoczesna-lampa-wiszaca-zlota-z-5-punktowymi-lampkami-led-kiko','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna lampa wisząca złota z 5-punktowymi lampkami LED - Kiko','W magazynie','Dostępny','',''),(8,1,1,'Prosty w swojej konstrukcji, ale to nie czyni Holz mniej pięknym. Właśnie dlatego, że jest tak prosta, jest to potężna lampa. Lampa wisząca wykonana jest z drewna z aluminium. Ma długość 98 cm i szerokość 80 cm. Ma regulowaną wysokość, minimalnie 39 cm i maksymalnie 150 cm. Sznurek ma długość 141 cm. Płyta montażowa ma wysokość 4 cm, długość 34 cm i szerokość 8 cm. Drewniany klosz ma wysokość 5 cm i szerokość 4,5 cm. Holz jest dostarczany wraz z oświetleniem LED. Ma strumień świetlny 3600 lumenów i 2700 kelwinów. To sprawia, że jest to prawdziwa potęga! Na szczęście lampę można również ściemniać za pomocą 3-stopniowego ściemniacza. Oznacza to, że po naciśnięciu własnego przełącznika światła po uzyskaniu 100% (pełnego) światła, po raz drugi uzyskasz 60% światła. A za trzecim razem otrzymujesz 30% (atmosferycznego) światła. Holz wytrzymuje średnio 40 000 godzin palenia. Holz tworzy atmosferę w Twoim salonie, biurze lub jadalni. Tego właśnie szukasz!','','nowoczesna-lampa-wiszaca-drewniana-z-3-stopniowym-sciemnianiem-led-holz','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna lampa wisząca drewniana z 3-stopniowym ściemnianiem LED - Holz','W magazynie','Dostępny','',''),(9,1,1,'Co za przytulna lampa wisząca Kiko! 5 punktów świetlnych wygląda jak świece zwisające z oprawy. Lampa wisząca wykonana jest z aluminium i wykończona w kolorze czarnym z wielokolorowymi odcieniami brązu. Ma długość 98 cm i szerokość 8 cm. Ma regulowaną wysokość, minimalnie 38,5 cm i maksymalnie 155 cm. Sznurek ma długość 146,5 cm. Płyta montażowa ma wysokość 4 cm, długość 34 cm i szerokość 8 cm. Każda z wielokolorowych czapek ma średnicę 4 cm i wysokość 4,5 cm. Dioda LED jest zintegrowana z oprawą i ma strumień świetlny 2000 lumenów i 2700 kelwinów. Daje to lampie wiszącej dużo dodatkowego, ciepłego, białego światła. Diodę można ściemniać za pomocą zewnętrznego ściemniacza (brak w zestawie). Kiko to idealna lampa wisząca nad stołem jadalnym lub w biurze. Nadaj swojemu wnętrzu atmosfery dzięki lampie wiszącej Kiko!','','nowoczesna-lampa-wiszaca-palona-stal-98-cm-z-5-punktowymi-diodami-led-kiko','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna lampa wisząca palona stal 98 cm z 5-punktowymi diodami LED - Kiko','W magazynie','Dostępny','',''),(10,1,1,'Lampa wisząca Kasbah wprowadzi iście królewską atmosferę do Twojego domu. \n\nLampa inspirowana jest stylem art deco. Konstrukcja lampy w połączeniu z kryształkami nadaje lampie klasy. A same kryształy pięknie odbijają światło tworząc przecudowną atmosferę w pomieszczeniu.\n\nŚrednica klosza: 50 cm\n\nWysokość klosza: 65 cm\n\nRegulowana wysokość w zakresie: 70-195 cm\n\nLampa jest gotowa do podłączenia do instala