st dobrze widoczne w oprawie. Michelle można ściemniać za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Piękna lampa wisząca do salonu, jadalni lub sypialni. Michelle to dodatek, którego szukasz!','','orientalna-lampa-wiszaca-rattan-49-cm-michelle','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Orientalna lampa wisząca rattan 49 cm - Michelle','W magazynie','Dostępny','',''),(49,1,1,'Dla kogoś, kto kocha prawdziwy design, Rowan jest doskonałym przykładem. Połączenie czarnego koloru i metalu nadaje lampie elegancki wygląd. Kształt lampy jest naprawdę wyjątkowy! Będzie dobrze wyglądać nad nowoczesnym stołem jadalnym lub w salonie. Lampa wisi na łącznej wysokości 130 cm i ma średnicę 56 cm. Płyta montażowa na suficie ma średnicę 16 cm. Dzięki zintegrowanej diodzie LED Rowan ma średnią żywotność 25 000 godzin. Dzięki 3300 lumenom i 3000 kelwinów zapewnia ciepłe, białe światło do wnętrza. Ci, którzy lubią więcej atmosfery, mogą również przyciemnić tę lampę, Rowan jest wyposażony w funkcję ściemniania! Szukasz przyciągającego wzrok w swoim domu? W takim razie wprowadź tę Rowan do swojego domu i uzupełnij swoje wnętrze!','','designerska-lampa-wiszaca-czarna-sciemnialna-led-56cm-rowan','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerska lampa wisząca czarna ściemnialna LED 56cm - Rowan','W magazynie','Dostępny','',''),(50,1,1,'Sanne to piękna lampa wisząca, która sprawdza się w nowoczesnym wnętrzu. Jego elegancki wygląd idealnie do tego pasuje. Sanne jest wykonany ze stali i wykończony na czarno. Ma długość 100 i szerokość 8 cm. Lampa wisząca ma regulowaną wysokość, minimalną 95 cm i maksymalnie 160 cm wysokości. Płyta montażowa ma wysokość 4 cm, długość 28 cm i szerokość 5,5 cm. Sznurek ma długość 150 cm. Sanne posiada 5 niewymiennych punktów świetlnych LED. Mają strumień świetlny 3000-5000 kelwinów i 350 lumenów. Lampa jest ściemniana za pomocą ściemniacza dotykowego, dzięki czemu sam określasz atmosferę w pomieszczeniu! Sanne wytrzymuje średnio 30 000 godzin palenia. Piękny dodatek do Twojego salonu, jadalni lub biura. Sanne dopełnia Twoje wnętrze!','','lampa-wiszaca-ze-stali-w-tym-led-z-dotykowym-sciemniaczem-5-punktowym-sanne','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Lampa wisząca ze stali, w tym LED z dotykowym ściemniaczem 5-punktowym - Sanne','W magazynie','Dostępny','',''),(51,1,1,'Anello to elegancka i nowoczesna lampa wisząca. \n\nGórna część pierścienia jest elegancka, matowa, czarna, a dolna część składa się z wbudowanego pierścienia LED.\n\nLampa wisząca Anello wyposażona została w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej 3000K na poziomie 2300 lumenów! Dioda ta uzyskała klasę energetyczną A, co oznacza, że jest nie tylko energooszczędna, ale zapewnia profity i dla Twojego portfela i dla środowiska. Wbudowany moduł LED gwarantuje 25 000 godzin świecenia. \n\nLampa wisząca Anello ma wbudowany system ściemniania. Po włączeniu lampy automatycznie zaczyna ona pokazywać zakres jasności. Ponowne naciśnięcie włącznika powoduje wybranie danej jasności.\n\nŚrednica płytki montażowej: 18 cm\n\nŚrednica klosza: 80 cm\n\nCałkowita wysokość: 130 cm (długość zawieszenia można skrócić)\n\nLampa Annello będzie pięknym uzupełnieniem aranżacji zarówno domowej, jak i biurowej.','','nowoczesna-lampa-wiszaca-pierscien-czarna-80-cm-led-sciemnialna-anello','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa wisząca pierścień czarna 80 cm LED ściemnialna - Anello','W magazynie','Dostępny','',''),(52,1,1,'Pua to piękna czarna lampa wisząca, która wprowadzi niepowtarzalny klimat do Twoich przestrzeni! Stylowy, przyciągający wzrok, wykończony ponadczasowym czarnym kolorem. Pua może być używana np. W salonie, sypialni czy nad wyspą kuchenną. Aby stworzyć dodatkową atmosferę, Pua można przyciemnić (ten ściemniacz nie jest dołączony). Posiada regulację wysokości: minimum 60 cm i maksimum 150 cm. Bardzo przydatne do określenia wysokości nad stołem jadalnym lub wyspą kuchenną! Klosz ma średnicę 66 cm. Płyta montażowa ma średnicę 10 cm. Ponieważ źródło światła jest widoczne, ozdobne źródło światła jest dodatkowym dodatkiem do lampy! Należy pamiętać, że źródło światła pasuje do oprawy E27 (maks. 40 W). To źródło światła nie jest dołączone i należy je zamówić osobno! Ulepsz swój dom dzięki naszej lampie wiszącej Pua.','','designerska-lampa-wiszaca-czarna-60-cm-pua','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerska lampa wisząca czarna 60 cm - Pua','W magazynie','Dostępny','',''),(53,1,1,'Lampa wisząca Kasbah to perełka do zobaczenia! Lampa wykonana z dbałością o szczegóły takie jak łańcuszek, wszelkie zdobienia na oprawie i oczywiście wszystkie kryształy. Poziome i pionowe słupki są pokryte (owinięte) przezroczystymi koralikami i kryształami umieszczonymi na każdej powierzchni. Daje to specjalny efekt świetlny, zarówno przy włączonym, jak i wyłączonym świetle. Design, wiele kryształów i srebrne wykończenie nadają lampie klasyczny wygląd, który doda Twojemu wnętrzu nieco więcej uroku. Lampa wisząca Kasbah ma średnicę 35 cm. Ogólna wysokość to 180 cm, którą można bardzo łatwo skrócić do 60 cm, usuwając szereg połączeń pomiędzy nimi. Płyta montażowa ma średnicę 11 cm. Uzupełnij Kasbah dwoma ładnymi źródłami światła o mocy do 40 watów, które pasują do dużej oprawy E27. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza, co zapewnia wyjątkowo przytulną atmosferę wieczorem. Ta wisząca lampa tworzy nastrój nad stołem jadalnym lub stolikiem kawowym. Podsumowując, elegancki dodatek do Twojego wnętrza!','','wiszaca-lampa-art-deco-krysztal-ze-srebrem-35-cm-kasbah','Meta description-Kula','Meta keywords-Kula','Meta title-Kula','Wisząca lampa art deco kryształ ze srebrem 35 cm - Kasbah','W magazynie','Dostępny','',''),(54,1,1,'Czy jesteś gotowy na przyciąganie wzroku do swojego domu? W takim razie Botanica jest tym, czego szukasz! Efektowny klosz przypominający liście natychmiast tworzy w domu wesołą atmosferę. Lampa wisząca wykonana jest ze stali i wykończona w mosiądzu. Ma średnicę 70 cm i jest regulowana na wysokość, minimalnie 52,5 cm i maksymalnie 292,5 cm. Płyta montażowa ma średnicę 40 cm i wysokość 3 cm. Sznurek ma długość 270 cm. Każdy klosz ma średnicę 30 cm i wysokość 20 cm. Uzupełniasz Botanicę o 5 źródeł światła, z których każde ma oprawkę E27 (maks. 60 Watt). Nie zapomnij zamówić ich osobno. Lampa wisząca ściemniana zewnętrznym ściemniaczem (brak w zestawie). Pomyśl tylko, jak piękna Botanica wisiała nad stołem jadalnym, stolikiem kawowym lub biurem. Nie wahaj się dłużej i wybierz tę wiszącą lampę w stylu vintage.','','vintage-lampa-wiszaca-mosiezna-5-punktowa-botanica','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Vintage lampa wisząca mosiężna 5-punktowa - Botanica','W magazynie','Dostępny','',''),(55,1,1,'Lampa wisząca Magna to przykład klasycznej i eleganckiej lampy. \n \nKlosz został wykonany z fiberglassu, a jego widoczna struktura powierzchni pięknie odbija emitowane światło.\n \nŚrednica klosza: 70 cm\n \nWysokość regulowana w zakresie: 70-135 cm\n \nLampa jest gotowa do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 3 gwinty na E27, każdy o maksymalnym poborze mocy do 60W. \n \nKolekcja Magna to synonim powabu i szyku. \n \nLampa wisząca Magna wnosi światło i sprawia, że nasz dom lśni jasnym światłem.','','nowoczesna-lampa-wiszaca-czarna-ze-zlotym-wnetrzem-70cm-magna','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa wisząca czarna ze złotym wnętrzem 70cm - Magna','W magazynie','Dostępny','',''),(56,1,1,'Wow, lampa wisząca Qara przyciągnie wzrok do Twojego wnętrza! Klosze mają piękny organiczny design. Szkło dymne zapewnia dodatkową atmosferę przy włączonym oświetleniu. Lampa wisząca wykonana jest ze szkła ze stalą i wykończona w kolorze złotym z czarnym. Ma długość 120 cm, szerokość 21 cm i jest regulowana na wysokość; minimum 64 cm i maksimum 150 cm. Więc zawsze wieszasz go na idealnej wysokości! Płyta montażowa ma wysokość 2,5 cm, długość 120 cm i szerokość 10 cm. Sznurek ma długość 126 cm. Każdy szklany klosz ma średnicę 21 cm i wysokość 21 cm. Kompletna Qara z 4 źródłami światła, każde z oprawą E27 o mocy maks. 40 Watt. Lampa wisząca jest ściemniana za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Qara pięknie prezentuje się nad stołem jadalnym, stołem do pracy lub w salonie. Dodaj atmosferę do swojego wnętrza z Qara!','','designerska-lampa-wiszaca-czarna-ze-zlotem-z-przydymionym-szklem-4-punktowa-qara','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerska lampa wisząca czarna ze złotem z przydymionym szkłem 4-punktowa - Qara','W magazynie','Dostępny','',''),(57,1,1,'Sanne to piękna lampa wisząca, która sprawdza się w nowoczesnym wnętrzu. Jego elegancki wygląd idealnie do tego pasuje. Sanne jest wykonany ze stali i wykończony na czarno. Ma długość 100 i szerokość 8 cm. Lampa wisząca ma regulowaną wysokość, minimalną 95 cm i maksymalnie 160 cm wysokości. Płyta montażowa ma wysokość 4 cm, długość 28 cm i szerokość 5,5 cm. Sznurek ma długość 150 cm. Sanne posiada 5 niewymiennych punktów świetlnych LED. Mają strumień świetlny 3000-5000 kelwinów i 350 lumenów. Lampa jest ściemniana za pomocą ściemniacza dotykowego, dzięki czemu sam określasz atmosferę w pomieszczeniu! Sanne wytrzymuje średnio 30 000 godzin palenia. Piękny dodatek do Twojego salonu, jadalni lub biura. Sanne dopełnia Twoje wnętrze!','','lampa-wiszaca-czarna-w-tym-led-z-dotykowym-sciemniaczem-5-punktowym-sanne','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Lampa wisząca czarna w tym LED z dotykowym ściemniaczem 5-punktowym - Sanne','W magazynie','Dostępny','',''),(58,1,1,'Ravi to efektowna lampa wisz