ła lub nad stołem jadalnym, aby ustawić piękne rośliny. Oprócz funkcjonalności jest to również bardzo ładna lampa wisząca, którą można zobaczyć dzięki eleganckiemu wzornictwu! Uwaga: maksymalna waga klatki zależy od wytrzymałości sufitu! Dobrze, jeśli wcześniej to sprawdzisz, bo lampka waży 9 kg. Cage Rack ma 118 cm długości, 25 cm szerokości i regulację wysokości od maksymalnie 150 cm do minimum 80 cm. Uzupełniasz tę wiszącą lampę czterema źródłami światła E27 o maksymalnej mocy 60 W każde. Lampa wisząca jest ściemniana za pomocą zewnętrznego ściemniacza. Źródła światła i ściemniacz nie są uwzględnione. Czy wnosisz nastrojowe oświetlenie czy funkcjonalne światło z Cage Rack? To wszystko jest możliwe!','','przemyslowa-lampa-wiszaca-czarna-z-duzym-stojakiem-4-punktowym-cage-rack','Meta description-Oblongue, Podłużny','Meta keywords-Oblongue, Podłużny','Meta title-Oblongue, Podłużny','Przemysłowa lampa wisząca czarna z dużym stojakiem 4-punktowym - Cage Rack','W magazynie','Dostępny','',''),(61,1,1,'Elegancka i nowoczesna lampa wisząca Blitz II będzie prawdziwą ozdobą domowej bądź biurowej aranżacji.\n\nUmieszczone w lampie zawiasy pozwalają na jej dostosowanie do indywidualnych preferencji.\n\nAby lampa pozostała w żądanym kształcie należy zablokować poszczególne elementy łączące.\n\nCałkowita wysokość: 150 cm\n\nŚrednica podsufitki: 15 cm\n\nŚrednica klosza: 35 cm\n\nWysokość klosza: 20 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 2 x 60W.\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 2 gwinty E27. \n\nLampa ta jest idealnym rozwiązaniem dla pomieszczeń w których nie jest możliwe zainstalowanie oświetlenia dokładnie nad stołem.','','lampa-wiszaca-regulowana-czarna-klosz-lniany-bialy-35cm-blitz-ii','Meta description-Cylindryczny, Oblongue, Okrągły','Meta keywords-Cylindryczny, Oblongue, Okrągły','Meta title-Cylindryczny, Oblongue, Okrągły','Lampa wisząca regulowana czarna klosz lniany biały 35cm - Blitz II','W magazynie','Dostępny','',''),(62,1,1,'Anello to elegancka i nowoczesna lampa wisząca. \n\nGórna część pierścienia jest elegancka, matowa, czarna, a dolna część składa się z wbudowanego pierścienia LED.\n\nLampa wisząca Anello wyposażona została w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej 2700K na poziomie 3000 lumenów! Dioda ta uzyskała klasę energetyczną A, co oznacza, że jest nie tylko energooszczędna, ale zapewnia profity i dla Twojego portfela i dla środowiska. Wbudowany moduł LED gwarantuje 30 000 godzin świecenia. \n\nLampa wisząca Anello ma wbudowany system ściemniania. Lampę można przyciemnić w trzech krokach. Oznacza to, że możesz sam wybrać pozycję ściemniania. W 1 trybie lampa emituje 100% mocy światła, w trybie 2 - 60%, a tryb 3 to oświetlenie nastrojowe, gdzie emitowane jest  tylko 30% mocy światła. Naciśnięcie przełącznika powoduje wybranie trybu świecenia.\n\nŚrednica płytki montażowej: 18 cm\n\nŚrednica klosza: 80 cm\n\nRegulowana wysokość w zakresie: 50-120 cm','','designerska-lampa-wiszaca-czarna-80-cm-led-sciemnialna-anello','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerska lampa wisząca czarna 80 cm LED ściemnialna - Anello','W magazynie','Dostępny','',''),(63,1,1,'Lampa wisząca Magna to przykład klasycznej i eleganckiej lampy. \n \nKlosz został wykonany z fiberglassu, a jego widoczna struktura powierzchni pięknie odbija emitowane światło.\n \nŚrednica klosza: 70 cm\n \nWysokość regulowana w zakresie: 70-135 cm\n \nLampa jest gotowa do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 3 gwinty na E27, każdy o maksymalnym poborze mocy do 60W. \n \nKolekcja Magna to synonim powabu i szyku. \n \nLampa wisząca Magna wnosi światło i sprawia, że nasz dom lśni jasnym światłem.','','nowoczesna-lampa-wiszaca-biala-70cm-magna','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa wisząca biała 70cm - Magna','W magazynie','Dostępny','',''),(64,1,1,'Brak opisu','','industriele-hanglamp-zwart-met-hout-en-rek-4-lichts-cage-rack','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Industriële hanglamp zwart met hout en rek 4-lichts - Cage Rack','W magazynie','Dostępny','',''),(65,1,1,'Mówiąc o stylowej lampie wiszącej, co powiesz na tę lampę wiszącą Facil? W efektownej oprawie jest miejsce na nawet 24 źródła światła. Fajnie, prawda?! Ten duży przyciągający wzrok ma długość 70 cm! Szerokość 13,5 cm, a sama oprawa ma wysokość 32 cm. Całkowita wysokość wynosi 120 cm, można ją skrócić do 60 cm podczas montażu. Ta efektowna czarna lampa wisząca Facil w stylu vintage ma 24 duże oprawy E27 i jest dostarczana bez źródeł światła, więc upewnij się, że zamówisz ją razem z nią (maks. 60 W każda). Oprawę można ściemniać za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Wybierz źródła światła, które można przyciemniać, ponieważ ta lampa wisząca ma tak wiele punktów świetlnych, że w ten sposób określisz odpowiednią atmosferę. Ta super fajna lampa wisząca jest piękna nad stołem jadalnym, ale także piękna w przedpokoju lub w biurze. Seria Facil jest dostępna w wielu różnych kolorach i wariantach.','','lampa-wiszaca-art-deco-czarna-24-punktowa-facil','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Lampa wisząca Art Deco czarna 24-punktowa - Facil','W magazynie','Dostępny','',''),(66,1,1,'Super nowoczesna i bardzo modna lampa wisząca, której klosze wykonane zostały z grubego, czarnego drutu. \n\nKlosze zamontowane są na drewnianej belce.\n\nLampa wisząca Arthur jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 3 x 40W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 3 gwinty na E27. \n\nCałkowita wysokość lampy: 110 cm (długość zawieszenia można skrócić)\n\nŚrednica klosza: 25 cm\n\nWysokość klosza: 22 cm\n\nDługość płytki montażowej: 94 cm\n\nAby podkreślić charakter lampy wybierz dekoracyjne żarówki z widocznym żarnikiem. \n\nLampa wisząca Artur będzie cudownym dodatkiem do industrialnego bądź loftowego wnętrza.','','industrialna-lampa-wiszaca-czarna-drewno-3-zrodla-swiatla-arthur','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Industrialna lampa wisząca czarna drewno 3-źródła światła - Arthur','W magazynie','Dostępny','',''),(67,1,1,'Zawieszenie do lampy wiszącej.\n\nŚrednica płytki montażowej: 10 cm\n\nDługość zawieszenia: 115 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy 60W.','','lampa-wiszaca-braz-czarny-kabel-combi-1','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Lampa wisząca brąz czarny kabel - Combi 1','W magazynie','Dostępny','',''),(68,1,1,'Lampy z serii Botanica to prawdziwa gratka dla osób, które lubią niecodzienne dodatki. To klasyka osadzona w nowoczesnym designie. \n\nLampa wisząca Botanica emituje przyjemne, nastrojowe światło.\n\nRegulowana wysokość w zakresie: 100-180 cm\n\nŚrednica: 32 cm\n\nWysokość: 63 cm\n\nŚrednica podsufitki: 11.5 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 2 x 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 2 gwintów na E27. \n\nŚwietnie sprawdzi się jako główne oświetlenie w salonie, jadalni czy sypialni.\n\nSprawdź pozostałe lampy z serii Botanica!','','lampa-wiszaca-vintage-zlota-2-zrodla-swiatla-botanica','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Lampa wisząca vintage złota 2-źródła światła - Botanica','W magazynie','Dostępny','',''),(69,1,1,'Designerska lampa wisząca nad stołem jadalnym: to jest Viola Due. Pięknie zaprojektowana i opływowa dzięki elastycznemu kształtowi lampy. Jest pięknie wykończona stalą i zintegrowanymi paskami LED. Ta dioda LED wytrzymuje średnio 30 000 godzin świecenia. Taśmy LED zapewniają moc 2100 lumenów i 2700 kelwinów: zapewnia to ciepłe, białe światło w pomieszczeniu. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza; możesz określić własną atmosferę w domu. Zwróć uwagę; ściemniacz nie jest wliczony w cenę. Ma całkowitą długość 91 cm i szerokość 26,5 cm. Możesz samodzielnie dopasować go do odpowiedniej wysokości, od 135 cm do 65 cm. Płyta montażowa na suficie ma średnicę 22,5 cm. Ta innowacyjna lampa sufitowa oferuje prawdziwy wygląd w Twoim wnętrzu dzięki swojej formie i funkcji. Kompaktowy rozmiar z zabawnymi ruchami sprawia, że Viola Due przyciąga wzrok na suficie. Twoje wnętrze dopełni lampa wisząca Viola Due.','','designerska-lampa-wiszaca-stal-sciemnialna-led-viola-due','Meta description-Oblongue, Organiczny','Meta keywords-Oblongue, Organiczny','Meta title-Oblongue, Organiczny','Designerska lampa wisząca stal ściemnialna LED - Viola Due','W magazynie','Dostępny','',''),(70,1,1,'Lampa wisząca Facil 3 to idealny wybór dla każdego miłośnika minimalistycznych i nowoczesnych rozwiązań.\n\nŚrednica podsufitki: 25 cm\n\nCałkowita wysokość: 140 cm (długość zawieszenia można skrócić)\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa Facil 3 wyposażona jest w 3 gwinty na E27, każdy o maksymalnym poborze mocy do 60W. \n\nZalecamy wybór dekoracyjnych żarówek, która dodatkowo podkreślą urok lampy.\n\nLampa nadaje się zarówno do przestrzeni domowej, jak i biurowej.\n\nPowieś kilka lamp Facil obok siebie, by stworzyć cudowną aranżację w pomieszczeniu.\n\nSprawdź pozostałe lampy z kolekcji Facil!','','nowoczesna-lampa-wiszaca-czarna-facil-3','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesna lampa wisząca czarna - Facil 3','W magazynie','Dostępny','',''),(71,1,1,'Efektowna lampa wisząca przeznaczona dla miłośników nowoczesnych rozwiązań, którzy uwielbiają minimalizm połączony z wysoką jakością wykonania. Czarne, matowe pręty w kształcie prostokątnej klatki to klasyka loftowego stylu.\n\nTo co wyróżnia lampę Cage Rack spośród innych to półka na której możesz położyć kwiaty, naczynia czy książki.\n\nWysokość regulowana w zakresie: 75-150 cm\n\nSzerokość: 20 cm\n\nWysokość: 41 cm\n\nDługość: 101.5 cm\n\nŚrednica przysufitki: 10 cm\n\nW komplecie: 4 x żarówka LED E27 A60 7W 800lm 2700K.\n\nZa pośrednictwem aplikacji można włączać/ wyłączać oświetlenie.\n\nAplikacja działa tylko przez WiFi. Jest kompatybilna również z Amazon Alexa i Google Home.\n\nLampa wisząca Cage Rack świetnie sprawdzi się we wnętrzach urządzonych w stylu skandynawskim i industrialnym.\n\nUWAGA: Maksymalnie obciążenie lampy Cage Rack zależy od wytrzymałości sufitu. Zalecamy sprawdzić to wcześniej.','','przemyslowa-lampa-wiszaca-czarna-z-polka-4-zrodla-swiatla-e27-wifi-cage-rack','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Przemysłowa lampa wisząca czarna z półką 4-źródła światła E27 WiFi - Cage Rack','W magazynie','Dostępny','',''),(72,1,1,'Designerskiej lampy wiszącej Wire Dos nie powinno zabraknąć w Twoim wnętrzu. Ta lampa idealnie pasuje do salonu, gabinetu czy sypialni. Jej elegancki wygląd i czarny kolor sprawiają, że jest to ponadczasowa lampa wisząca. Jej pionowe słupki zapewniają piękny efekt świetlny w pomieszczeniu. Lampa wisząca wykonana jest ze stali i wykończona w kolorze czarnym. Lampa wisząca ma średnicę 50 cm i jest regulowana na wysokość: minimum 92 cm i maksimum 182 cm. Sznurek ma długość 120 cm. Płyta montażowa ma średnicę 12 cm i wysokość 4 cm. Stalowy klosz ma średnicę 50 cm i wysokość 58 cm. Uzupełniasz Wire Dos o źródło światła z oprawą E27 (maks. 40 Watt). Więc nie zapomnij zamówić ich osobno! Wybierz źródło światła, które również ładnie wygląda, ponieważ jest wyraźnie widoczne w oprawie. Aby stworzyć jeszcze większą atmosferę, możesz podłączyć lampę do ściemniacza, który nie jest w zestawie. Wire Dos zapewnia nowoczesny akcent w Twoim wnętrzu, którego szukasz!','','designerska-lampa-wiszaca-czarna-50-cm-wire-dos','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerska lampa wisząca czarna 50 cm - Wire Dos','W magazynie','Dostępny','',''),(73,1,1,'Kolekcję lamp Mangoes wyróżnia ciekawy design i najwyższa jakość wykonania. Duże klosze w stylu industrialnym nadają lampie wyrazu, a drewniana przysufitka stanowi piękny dodatek i podkreśla charakter lampy.\n\nDługość podsufitki: 42 cm\n\nWysokość klosza: 25 cm\n\nŚrednica klosza: 30 cm\n\nCałkowita wysokość lampy: 140 cm (długość zawieszenia można skrócić)\n\nLampa wisząca Mangoes jest gotowa do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest 2 gwinty na E27, każdy o maksymalnym poborze mocy do 25W. \n\nKolekcja Mangoes świetnie prezentować się będzie nie tylko w surowych, przemysłowych wnętrzach, ale również w bardziej klasycznych i stonowanych aranżacjach.','','przemyslowa-lampa-wiszaca-czarna-drewno-2-zrodla-swiatla-mangoes','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Przemysłowa lampa wisząca czarna drewno 2-źródła światła - Mangoes','W magazynie','Dostępny','',''),(74,1,1,'Sicko zapewnia chłodny akcent w każdym wnętrzu! Klosz ma wysokość 60 cm i średnicę 53 cm. Płyta montażowa do sufitu ma średnicę 12 cm. Całkowita wysokość to 215 cm, można ją skrócić podczas montażu. Kaptur wykończony jest na dole szklanym blenderem. Zapewnia to przyjemny rozsył światła w domu. Ta wytrzymała lampa wisząca jest wyposażona w inteligentne źródło światła E27 A60, które możesz ustawić w dowolnym kolorze za pomocą telefonu i/lub inteligentnego asystenta domowego. Źródło światła zużywa maksymalnie 8,5 watów i ma średni czas świecenia 15 000 godzin. Sam ustawiasz idealne natężenie światła (do 806 lumenów) i idealną barwę światła (od 2200 do 4000 kelwinów), aby stworzyć idealną atmosferę. Wybierz przyjemną atmosferę w domu dzięki tej surowej lampie wiszącej!','','inteligentna-przemyslowa-lampa-wiszaca-czarna-53-cm-z-a60-wifi-sicko','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Inteligentna przemysłowa lampa wisząca czarna 53 cm z A60 Wifi - Sicko','W magazynie','Dostępny','',''),(75,1,1,'Wow, jaka piękna jest lampa wisząca Lyani! To pięknie wisi nad stołem jadalnym lub w biurze. Lampa wisząca wykonana jest ze stali z aluminium i wykończona w chromie. Ma długość 115 cm, szerokość 30 cm i jest regulowana na wysokość. Maksymalnie 150 cm i minimum 50 cm. Płyta montażowa ma długość 90 cm, szerokość 6 cm i wysokość 4 cm. Lampa wisząca posiada 3 punkty świetlne, każdy ze zintegrowanym oświetleniem LED. Ma strumień świetlny 2315 lumenów i 3000 kelwinów. To sprawia, że jest to prawdziwa potęga! Na szczęście lampę wiszącą można również ściemniać za pomocą 3-stopniowego ściemniacza. Oznacza to, że gdy raz naciśniesz własny włącznik światła, otrzymasz 100% światła. Za drugim razem dostajesz 60% światła. A za trzecim razem otrzymujesz 30% (atmosferycznego) światła. Super poręczny, dzięki czemu zawsze masz odpowiednią atmosferę w pokoju! Lampa wisząca wytrzymuje średnio 25 000 godzin palenia. Ta piękna nowoczesna lampa wisząca jest prawdziwym dodatkiem do Twojego wnętrza i dlatego z pewnością nie można jej przegapić!','','lampa-wiszaca-chrom-w-tym-3-stopniowa-sciemniana-lampa-led-3-punktowa-lyani','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Lampa wisząca chrom, w tym 3-stopniowa ściemniana lampa LED 3-punktowa - Lyani','W magazynie','Dostępny','',''),(76,1,1,'Piękna przemysłowa lampa wisząca od QAZQA! Ta lampa wisząca Arthur to obraz do zobaczenia. W pełni pasuje do wnętrza industrialnego lub w stylu Art Deco. Użycie drewna i czarnego koloru nadaje tej lampie ponadczas