olekcji lusterek kosmetycznych Vicino.\n\nŁamany wysięgnik sprawdzi się w każdej, nawet najmniejszej łazience.\n\nLusterko można również przechylać i obracać. Jest dwustronne, jedna strona 1:1, druga strona powiększa dwukrotnie.\n\nLusterko jest na baterie: 3 x AA.\n\nNa lusterku jest dotykowy włącznik za pomocą którego możesz regulować również temperaturę barwową w zakresie od chłodnej po ciepłą.\nPrzy pierwszym dotknięciu włącza się oświetlenie o chłodnej barwie (6500K). Drugie dotknięcie - barwa ciepło biała (3000K). Trzecie - barwa neutralna (4000K). Za czwartym wyłączasz oświetlenie lusterka.\n\nMoc emitowanego światła to 80 lumenów.\n\nCałkowita wysokość: 27 cm\n\nŚrednica płytki montażowej: 10 cm\n\nŚrednica lusterka: 17.5 cm\n\nLusterko kosmetyczne Vicinio posiada podwyższony stopień ochrony IP44, co oznacza, że nadaje się do pracy w wilgotnych pomieszczeniach.','','designerskie-lustro-lazienkowe-chrom-regulowane-led-ip44-3000k-6500k-vicino','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerskie lustro łazienkowe chrom regulowane LED IP44 3000K-6500K - Vicino','W magazynie','Dostępny','',''),(148,1,1,'Prawdziwy retro must-have, ale w wielofunkcyjnej kurtce! Miral to ładne lustro łazienkowe z dotykowym ściemniaczem. Dzięki temu sam określasz jasność lustra, dotykając lustra. W ten sposób nigdy nie będzie Ci przeszkadzało zbyt jasne światło o poranku. Miral wykonany jest ze szkła z aluminium i jest w kolorze miedzi. Ma głębokość 3,8 cm, wysokość 90 cm i długość 60 cm. Ten produkt jest dostarczany z niewymiennym oświetleniem LED (23,5 W), które wytrzymuje średnio 30 000 godzin świecenia. Dzięki mocy świetlnej 2700 kelwinów i 2397 lumenów jest to prawdziwa potęga z funkcjonalnym światłem, ale łatwo ją ściemniać za pomocą ściemniacza dotykowego. Dzięki wartości IP IP44 lustro jest bryzgoszczelne, idealne do użytku w łazience! Jesteśmy całkowicie zakochani w tym Miralu.','','lustro-lazienkowe-miedziane-w-tym-led-z-owalnym-sciemniacze