as czytania książki. Ma minimalną długość 70 cm i maksymalną długość 130 cm. Lampę można również przyciemnić zewnętrznym ściemniaczem. Dzięki pięknemu źródłu światła, które pasuje do dużej oprawki E27 o maksymalnej mocy 40 watów, możesz całkowicie ukończyć to Rego. Uwaga: źródło światła i ściemniacz nie są wliczone, ale można łatwo zamówić w naszym sklepie internetowym. Stwórz rustykalną atmosferę w sypialni lub kąciku do czytania z Rego.','','rustykalny-kinkiet-regulowany-rdza-rego','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Rustykalny kinkiet regulowany rdza - Rego','W magazynie','Dostępny','',''),(158,1,1,'Elegancki design tego przemysłowego kinkietu sprawia, że ten kinkiet przyciąga wzrok w Twoim domu. Odchylany klosz pozwala oświetlić światło tam, gdzie jest potrzebne. To sprawia, że ta lampa doskonale sprawdza się jako oświetlenie podstawowe, nastrojowe lub funkcjonalne. Dodatkowo drążki z przodu okapu dają ładny efekt świetlny na ścianie. Ten kinkiet ma długość 21,5 cm, wysokość 15 cm i głębokość 28 cm. Płyta montażowa ma głębokość 4 cm i średnicę 10 cm. Uzupełniasz ten kinkiet źródłem światła E14 o maksymalnej mocy 40 watów. Wolisz trochę bardziej nastrojowe oświetlenie? Ściemnianie tego kinkietu jest możliwe za pomocą zewnętrznego ściemniacza. Uwaga: źródło światła i ściemniacz nie są dołączone. Dzięki tej lampie ściennej możesz oświetlić piękny mebel, taki jak chłodna szafka w swoim domu. Jest to również idealna lampa do kącika do czytania. Gdzie pozwolisz tej kinkiecie zabłysnąć?','','przemyslowa-lampa-scienna-czarna-uchylna-pekka','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Przemysłowa lampa ścienna czarna uchylna - Pekka','W magazynie','Dostępny','',''),(159,1,1,'Wow, jak przyciąga wzrok ten Sjaak. Prawdziwie cukierek dla oka! Ten kinkiet wykonany jest z aluminium i jest czarny z wielokolorowym kolorem, co nadaje pomieszczeniu nowoczesny i tajemniczy wygląd. Sjaak ma długość 45 cm, wysokość 1