znego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Wybierz źródła światła, które można przyciemniać, ponieważ ten kinkiet ma tak wiele punktów świetlnych, że w ten sposób określisz odpowiednią atmosferę. Ta super fajna duża lampa ścienna jest piękna w salonie, ale także w przedpokoju lub biurze. Zapewnia szykowny hotelowy wygląd. Seria Facil jest dostępna w wielu różnych kolorach i wariantach.','','kinkiet-vintage-zloty-6-punktowy-facil','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Kinkiet vintage złoty 6-punktowy -Facil','W magazynie','Dostępny','',''),(188,1,1,'Wow, co to za szykowna lampa Hikina! Połączenie bieli i złota w strukturze zapewnia orientalny charakter. Kinkiet przyciąga wzrok dzięki swojemu wyjątkowemu wzornictwu! Hikina jest wykonana ze stali i wykończona na biało ze złotem. Ma głębokość 13 cm, długość 85 cm i wysokość 48 cm. Uzupełniasz kinkiet o 2 źródła światła, z których każde ma oprawkę E27 (maks. 25 Watów). Nie zapomnij zamówić ich osobno. Aby stworzyć więcej atmosfery, lampę można podłączyć do ściemniacza, którego nie ma w zestawie. Ponieważ koła mają różne rozmiary i są umieszczone jeden na drugim, lampa tworzy głębię i uzyskuje się piękny efekt świetlny na ścianie, gdy lampa jest włączona. Postaw na atmosferę w swoim wnętrzu dzięki lampie ściennej Hikina!','','orientalny-kinkiet-zloty-z-bialymi-2-lampkami-hikina','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Orientalny kinkiet złoty z białymi 2-lampkami - Hikina','W magazynie','Dostępny','',''),(189,1,1,'Kolekcja Kreta naśladuje tradycyjne wzornictwo, dostosowując je do najnowszych trendów wnętrzarskich.\n\nPołączenie rdzawobrązowego korpusu ze złotymi kloszami rozjaśnia i dekoruje wnętrze dodając mu blasku.\n\nStruktura klosza zapewnia piękny efekt świetlny w pomieszczeniu.\n\nCałkowita wysokość: 42.5 cm\n\nOdległość od ściany: 13 cm\n\nŚrednica klosza: 10 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 2 gwinty na G9, każdy o maksymalnym poborze mocy do 40W. \n\nKinkiet Kreta posiada włącznik światła wbudowany w korpus lampy przy płytce montażowej.\n\nKinkiet Kreta doskonale sprawdzi się w klasycznych pomieszczeniach, jak i nowoczesnych aranżacjach.','','rustykalny-kinkiet-rdza-wlacznik-2-zrodla-swiatla-kreta','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Rustykalny kinkiet rdza włącznik 2-źródła światła - Kreta','W magazynie','Dostępny','',''),(190,1,1,'Elegancki kinkiet Athens idealnie wpasowuje się zarówno w styl klasyczny jak i nowoczesny. Ponadto, połączenie złota i przydymionego szkła nadaje lampie szyku. \n\nŚrednica płytki montażowej: 12 cm\n\nWysokość: 41 cm\n\nDługość: 23 cm\n\nŚrednica klosza: 10 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 2 x 28W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 2 gwinty na G9.\n\nKinkiet Athens sprawi, że Twoje wnętrze nabierze charakteru. Świetnie sprawdzi się w kuchni, salonie, sypialni lub w przedpokoju.\n\nW serii Athens znajdziesz bogaty wybór lamp!','','kinkiet-art-deco-zloty-przydymione-szklo-2-zrodla-swiatla-athens','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Kinkiet art deco złoty przydymione szkło 2-źródła światła - Athens','W magazynie','Dostępny','',''),(191,1,1,'Nowoczesny i elegancki kinkiet Justin emituje nastrojowe światło góra-dół tworząc przy tym piękny efekt świetlny na ścianie. \n\nDługość: 45 cm\n\nWysokość: 11 cm\n\nOdległość od ściany: 7 cm\n\nKinkiet jest gotowy do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 4 x 40W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 4 gwinty na G9. \n\nKolekcja Justin sprawdzi się jako oświetlenie pośrednie zarówno w przedpokoju, sal