tion-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Kinkiet Art Deco czarny 6 lampek - Facil','W magazynie','Dostępny','',''),(230,1,1,'Wytrzymała lampa przemysłowa w pięknym białym / kremowym satynowym wykończeniu. Kinkiet ma fajny, industrialny wygląd i jest również dostępny jako lampa wisząca (Industrial 37). Abażur można przechylać. Co więcej, jest ściemnialny (nie zawiera ściemniacza), dzięki czemu możesz stworzyć idealną atmosferę. Lampa nadaje się do jadalni, kuchni lub salonu. Lampa ma głębokość 37,5 cm i wysokość 25 cm. Płyta montażowa ma średnicę 10,5 cm.  W tym urządzeniu pasują źródła światła o klasie energetycznej od A ++ do E. Zamawiając źródło światła, które pasuje do oprawy E27 (maks. 40 W), należy zakończyć tę lampę wiszącą. The Industrial to naprawdę fajny dodatek do twojego domu.','','kinkiet-przemyslowy-kremowy-przemyslowy','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Kinkiet przemysłowy kremowy - Przemysłowy','W magazynie','Dostępny','',''),(231,1,1,'Szukasz kinkietu obok swojego łóżka? W takim razie kinkiet Kata z rattanowym kloszem to super atrakcyjne rozwiązanie! Świetnie sprawdzi się jako oświetlenie funkcjonalne lub nastrojowe do salonu, sypialni czy jadalni. Kinkiet ma długość 16 cm, wysokość 25 cm i głębokość 28 cm. Płyta montażowa ma średnicę 10 cm i głębokość 2,5 cm. Do kinkietu dołączony jest przewód (180 cm) z wtyczką. Uzupełnij kinkiet o źródło światła E27 (maks. 25 W). Chcesz przyciemnić oświetlenie? Jest to możliwe dzięki zewnętrznemu ściemniaczowi. Uwaga: źródło światła i ściemniacz nie są dołączone. Ta lampa może być również idealnym dodatkiem do Twojego salonu lub jadalni. Gdziekolwiek umieścisz ten kinkiet, dzięki rattanowemu kloszowi natychmiast wprowadzisz atmosferę do swojego domu!','','kinkiet-wiejski-czarny-z-rattanowym-kloszem-kata','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Kinkiet wiejski czarny z rattanowym kloszem - Kata','W magazynie','Dostępny','',''),(232,1,1,'Szukasz atrakcyjnej lampy ściennej? Ten Sprout jest tym, czego szukasz! Urocza, ale wiejska oprawa. Kinkiet wykonany jest z drewna ze stalą, stal wykończona jest w kolorze czarnym. Ma głębokość 17,5 cm, wysokość 30 cm i długość 13,8 cm. Płyta montażowa ma głębokość 2,5 cm i średnicę 9,7 cm. Stalowy klosz ma średnicę 13,8 cm i wysokość 13,5 cm. Uzupełniasz kinkiet o źródło światła z oprawą E27 (maks. 60 Watt). Upewnij się, że zamawiasz je osobno. Kikut można przyciemniać za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Spraw, by w domu było przytulnie dzięki wiejskiej lampie ściennej Stronk.','','wiejska-lampa-scienna-czarna-z-drewnem-stronk','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Wiejska lampa ścienna czarna z drewnem - Stronk','W magazynie','Dostępny','',''),(233,1,1,'Bardzo ładny kinkiet do salonu, sypialni czy gabinetu. Chantal to czarny, nowoczesny kinkiet, wykonany ze stali z dodatkiem tkaniny. Ma wysokość 28 cm, długość 28 cm i szerokość 147,5 cm. Płyta montażowa ma wysokość 10 cm, głębokość 3 cm i długość 5,5 cm. Klosz ma średnicę 28 cm i wysokość 18 cm. Chantal jest dostarczany z przewodem (200 cm) i wtyczką. Kompletujesz kinkiet ze źródłem światła z oprawą E27 (max. 40 Watt). Nadal musisz je zamówić osobno. Kinkiet można ściemniać za pomocą zewnętrznego ściemniacza, który nie jest dołączony. Dzięki regulowanemu ramieniu Chantal możesz zdecydować, gdzie ma świecić światło, na przykład idealne do łatwego czytania książki w łóżku! W Twoim wnętrzu nie powinno zabraknąć nowoczesnego kinkietu Chantal!','','nowoczesny-kinkiet-czarny-regulowany-chantal','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesny kinkiet czarny regulowany - Chantal','W magazynie','Dostępny','',''),(234,1,1,'Wow, ta lampa pięknie wygląda w łazience! Dzięki wartości IP IP44 jest do tego bardzo odpowiedni. Coś dla Ciebie? Kinkiet Bath to czarna stalowa lampa ze szkłem. Są w nim dwa punkty świetlne.