ma regulowaną długość, od 35 cm do 59 cm. Możesz więc wybrać, gdzie chcesz, aby światło świeciło! Płyta montażowa ma wysokość 24 cm i szerokość 6 cm. Klosz ma średnicę 10,5 cm i wysokość 19 cm. Klatka nożycowa jest dostarczana z kablem o maksymalnej długości 235 cm. Połączenie stalowego ramienia i pięknego wykończenia kaptura sprawia, że jest naprawdę wyjątkowy! Widoczne źródło światła dodatkowo przyciąga wzrok. Wykończ klatkę nożyczek ładnym źródłem światła o maksymalnej mocy 40 W, które pasuje do oprawy E27. Nadal musisz je zamówić osobno. Lampę można również ściemniać za pomocą zewnętrznego ściemniacza; więc określ swoją atmosferę. Wybierz w domu kinkiet w stylu vintage z nożyczkami!','','przemyslowy-kinkiet-czarny-regulowany-scissors-cage','Meta description-Oblongue, Organiczny','Meta keywords-Oblongue, Organiczny','Meta title-Oblongue, Organiczny','Przemysłowy kinkiet czarny regulowany - Scissors Cage','W magazynie','Dostępny','',''),(244,1,1,'Idealny do sypialni lub kącika do czytania: ten kinkiet Rela! Piękna w rustykalnym lub industrialnym wnętrzu. Kinkiet ma betonowo-szary kolor: ten specjalny materiał przyciąga wzrok w Twojej sypialni. Płyta montażowa ma długość 20 cm i szerokość 15 cm.  Dzięki regulowanemu ramieniu możesz świecić światłem, gdziekolwiek chcesz! Idealny podczas czytania książki. Ma minimalną wysokość 70 cm i maksymalną wysokość 160 cm. Dzięki pięknym źródłom światła, które pasują do dużej oprawki E27 o maksymalnej mocy 40 watów, możesz ukończyć to Rela. Lampa dostarczana jest z przewodem i wtyczką (długość 185 cm). Możesz również przyciemnić go za pomocą zewnętrznego ściemniacza! Uwaga; źródło światła i ściemniacz nie są wliczone, ale można łatwo zamówić w naszym sklepie internetowym. Spraw, aby Twoja sypialnia była całkowicie fajna dzięki tej Rela.','','lampa-scienna-regulowana-przemyslowa-metal-rela','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Lampa ścienna regulowana przemysłowa metal - Rela','W magazynie','Dostępny','',''),(245,1,1,'Prawdziwa wizytówka, nasza lampa ścienna Neon Love! Przez cały ten czas ukłon w stronę znanego oświetlenia neonowego. Wyposażony w wesoły kolor i podobny kształt, to maksymalna przyjemność tego kreatora nastroju! Kolekcja QAZQAx Silver blue! Lojalni czytelnicy bloga Zilverblauw często widzieli ten neon przechodzący przez kanały mediów społecznościowych. Anki i Casper zaprojektowali własną lampę neonową w formie słowa „Miłość”. Za każdym razem, gdy neon był na zdjęciu, Anki zalewała pytania, gdzie go kupiła. Teraz ta wyjątkowa lampa „Love” jest naprawdę na sprzedaż, możliwa dzięki samej Anki! Ściemnialna lampa ma wysokość 40 cm i szerokość 62 cm. Możesz go włączać i wyłączać za pomocą pilota, ale możesz go również przyciemnić. Daje 365 lumenów i do 50 000 godzin świecenia dzięki niewymiennej diodzie LED. Zdobądź ten przyciągający wzrok teraz i ciesz się dodatkową miłością w swoim wnętrzu!','','kinkiet-bialy-z-pilotem-w-tym-led-neon-love','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Kinkiet biały z pilotem, w tym LED - Neon Love','W magazynie','Dostępny','',''),(246,1,1,'Bardzo fajny kinkiet do domu! Bram łatwo dopasowuje się do Twojego wnętrza. Ta lampa ścienna wykonana jest ze stali z plastikiem i jest biała. Ma głębokość 4,8 cm, wysokość 8 cm i długość 35 cm. Płyta montażowa ma głębokość 3,5 cm, wysokość 6 cm i długość 25 cm. Bram posiada niewymienne oświetlenie LED. Z mocą świetlną 2700-6000 kelwinów i 1400 lumenów to prawdziwa potęga! Lampę można przyciemniać za pomocą 3-stopniowego ściemniacza, więc to Ty decydujesz, jak jasno ma świecić światło. Oznacza to, że gdy naciśniesz własny włącznik światła, gdy uzyskasz 100% (funkcjonalne) światło, za drugim razem uzyskasz 60% światła, a trzeci raz 30% (atmosferyczne). Bram wytrzymuje średnio 25 000 godzin palenia. Bram to nowoczesny kinkiet, który idealnie pasuje do salonu, gabinetu czy biura. Naprawdę coś dla Ciebie!','','nowoczesny-kinkiet-bialy-35-cm-z-3-stopniowym-sciemnianiem-led-bram','Meta description-Owalny','Meta keywords-Owalny','Meta title-Owalny','Nowoczesny kinkiet biały 35 cm z 3-stopniowym ściemnianiem LED - Bram','W magazynie','Dostępny','',''),(247,1,1,'Mersey pochodzi prosto z industrialnego loftu! Połączenie cynku i regulowanego ramienia nadaje mu mocny wygląd, dokładnie taki, jakiego potrzebujesz w swoim industrialnym wnętrzu. Kinkiet ma wysokość 42 cm i długość 63,5 cm. Ma regulowaną wysokość od minimum 43,5 cm do maksymalnie 109,5 cm. Płyta montażowa ma średnicę 11,8 cm. Uzupełniasz Mersey ze źródłem światła z oprawą E27 (maks. 40 W). Kinkiet można ściemniać za pomocą zewnętrznego ściemniacza, który nie jest dołączony. Dzięki regulowanemu ramieniu możesz świecić tam, gdzie chcesz! Uzupełnisz swoje biuro, kuchnię lub salon za pomocą tego Mersey.','','industrialny-kinkiet-szary-regulowany-mersey','Meta description-Oblongue, Organiczny','Meta keywords-Oblongue, Organiczny','Meta title-Oblongue, Organiczny','Industrialny kinkiet szary regulowany - Mersey','W magazynie','Dostępny','',''),(248,1,1,'Jak fajna jest ta wisząca lampa z miejscem na roślinę? Ten fajny kinkiet jest wyposażony w szklany słoik (bez rośliny), w którym możesz przechowywać swoją ulubioną roślinę doniczkową. Daje to wspaniałe połączenie nastrojowego światła i roślin w Twoim domu. Ten kinkiet ma długość 12 cm, wysokość 45 cm i głębokość 20,5 cm. Płyta montażowa ma średnicę 10 cm i głębokość 2,5 cm. Uzupełniasz tę lampę źródłem światła E27 o mocy do 60 W. Lampę można również ściemniać za pomocą zewnętrznego ściemniacza. Źródło światła i ściemniacz nie są dołączone. Ten kinkiet może służyć jako oświetlenie podstawowe i funkcjonalne. Uzupełnij swoje wnętrze o kinkiet Roslina!','','nowoczesny-kinkiet-czarny-roslina','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesny kinkiet czarny - Roslina','W magazynie','Dostępny','',''),(249,1,1,'Kinkiet Combi pełni funkcję zarówno dekoracyjną, jak i praktyczną. Kreuje klimat, dodając aranżacji przytulności. \n\nKlasyczny klosz nadaje lampie elegancji i ponadczasowego charakteru. \n\nCałkowita wysokość: 32 cm\n\nOdległość od ściany: 23 cm\n\nŚrednica płytki montażowej: 11 cm\n\nWysokość klosza: 20 cm\n\nŚrednica klosza: 20 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy 60W. \n\nPonadto, kinkiet posiada włącznik światła zamontowany na podstawie.\n\nKinkiet Combi świetnie sprawdzi się jako oświetlenie pośrednie w sypialni, salonie lub w przedpokoju.','','klasyczny-kinkiet-z-wlacznikiem-zloty-klosz-welurowy-pawie-oczka-20-20-20-combi','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Klasyczny kinkiet z włącznikiem złoty klosz welurowy pawie oczka 20/20/20 - Combi','W magazynie','Dostępny','',''),(250,1,1,'Szukasz lampy ściennej o solidnym wyglądzie? W takim razie Balenco Wazo może być tym, czego szukasz. Ten kinkiet natychmiast nada Twojemu domowi nowoczesny wygląd. Uzupełnij tę lampę o piękne źródło światła E27 o mocy do 40 W (źródło światła nie jest dołączone). Listwy w kapturze od razu dają ładny efekt świetlny. Możesz przyciemnić lampę za pomocą zewnętrznego ściemniacza (brak w zestawie), aby stworzyć idealną atmosferę. Lampa ma 14 cm długości, 45 cm wysokości i 14 cm głębokości. Płyta montażowa ma 14 cm długości, 45 cm wysokości i 2 cm głębokości. Balenco Wazo doskonale sprawdza się jako oświetlenie podstawowe i nastrojowe. Uczyń swoje wnętrze nowoczesnym dzięki tej wyjątkowej lampie ściennej!','','nowoczesny-kinkiet-czarny-balenco-wazo','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesny kinkiet czarny - Balenco Wazo','W magazynie','Dostępny','',''),(251,1,1,'Nowoczesny kinkiet Matti idealnie sprawdzi się w łazience. Posiada stopień ochrony IP44, który zapewnia bezpieczną pracę przy spadających kroplach wody. \n\nKinkiet Matti został wykonany z tworzywa sztucznego i metalu.\nMleczny klosz sprawia, że emitowane światło jest delikatniejsze i przyjemniejsze w ogólnym odbiorze.\n\nKinkiet Matti wyposażony został w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej 3000K na poziomie 880 lumenów! Dioda ta uzyskała klasę energetyczną A, co oznacza, że jest nie tylko energooszczędna, ale zapewnia profity i dla Twojego portfela i dla środowiska. \nWbudowany moduł LED gwarantuje 30 000 godzin świecenia. \n\nSzerokość: 80 cm\n\nGłębokość: 8 cm\n\nWymiary płytki montażowej: 15x5,5 cm\n\nPołączenie bieli z chromem jest z jednej strony nowoczesne, ale z drugiej strony nawiązuje do klasycznych rozwiązań. Od dziś funkcjonalne oświetlenie łazienki nabiera nowego znaczenia!','','nowoczesny-kinkiet-lazienkowy-chrom-80cm-led-ip44-matti','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesny kinkiet łazienkowy chrom 80cm LED IP44 - Matti','W magazynie','Dostępny','',''),(252,1,1,'Kinkiet Facil to idealny wybór dla każdego miłośnika minimalistycznych i nowoczesnych rozwiązań.\n\nCałkowita wysokość (bez żarówki): 8.5 cm\n\nŚrednica płytki montażowej: 6.6 cm\n\nOdległość od ściany: 13 cm\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy do 60W. \n\nZalecamy wybór dekoracyjnej żarówki, która dodatkowo podkreśli urok lampy.\n\nSprawdź pozostałe lampy z kolekcji Facil!','','nowoczesny-kinkiet-czarny-facil-1','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesny kinkiet czarny - Facil 1','W magazynie','Dostępny','',''),(253,1,1,'Wielofunkcyjny kinkiet, ten Flero. Ta lampa jest wykończona w białym kolorze z przyłączem USB do ładowania tabletu i / lub smartfona! Bardzo funkcjonalny i ponadczasowy.  Możesz ustawić ramię elastyczne tak, jak chcesz, abyś mógł określić, gdzie świeci światło! Kinkiet ma całkowitą wysokość 45 cm i szerokość 18 cm. Płyta montażowa do ściany ma wysokość i głębokość 10 cm.  Flexarm składa się ze zintegrowanej diody LED 2700 kelwinów i 100 lumenów. Flero świeci przez wnętrze przytulnym ciepłym światłem! To idealna lampa do czytania do sypialni. Uwaga: tej lampy nie można przyciemniać.  Uzupełnij swoją sypialnię lampą ścienną Flero.','','nowoczesny-kinkiet-bialy-z-usb-i-ramieniem-flero','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesny kinkiet biały z USB i ramieniem - Flero','W magazynie','Dostępny','',''),(254,1,1,'Szukasz fajnej industrialnej lampy ściennej? W takim razie przestań szukać, ta szubienica jest dokładnie tym, czego szukasz! Dzięki zastosowaniu surowców, takich jak metal, w połączeniu z naturalnymi elementami, takimi jak drewno, ta lampa ścienna idealnie pasuje do Twojego solidnego wnętrza. Ta lampa ścienna doskonale sprawdza się jako lampka nocna w sypialni, ale jest również bardzo przyjemna w przedpokoju lub salonie. Zwróć uwagę! W tej lampie nie ma przewodu ani wtyczki, ale jest bardzo łatwy do samodzielnego złożenia. Płyta montażowa ma długość 16,5 cm, ma szerokość 21 cm, a kabel ma długość 23 cm. Ta lampa ścienna jest wyposażona w inteligentne źródło światła E27 G95 o maksymalnej mocy 806 lumenów i 1800 do 3000 kelwinów. Lampa ma pobór mocy 7 W i średnio 15 000 godzin świecenia. Lampa jest łatwa w obsłudze za pomocą smartfona lub inteligentnego asystenta domowego, prosto z kanapy! Dzięki inteligentnemu wariantowi Gallowlamp otrzymujesz wielofunkcyjną lampę w swoim domu, która zawsze tworzy odpowiednią atmosferę! Nie szukaj dalej, zamów ten idealny kinkiet przemysłowy już teraz.','','inteligentna-przemyslowa-lampa-scienna-czarna-z-drewnem-w-tym-wifi-g95-gallow','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Inteligentna przemysłowa lampa ścienna czarna z drewnem, w tym WiFi G95 - Gallow','W magazynie','Dostępny','',''),(255,1,1,'Cóż za wesoły kinkiet Fringle! Twoje wnętrze natychmiast zyska dzięki temu ożywienie. Zielone frędzle na tej lampie naprawdę nadają lampie zabawny efekt. Fringle wykonany jest ze stali z tkaniną i wykończony w kolorze złotym z zielonym. Lampa ma wysokość 37 cm, głębokość 26 cm i długość 20 cm. Płyta montażowa ma głębokość 2 cm i średnicę 16 cm. Sznur ma długość 180 cm. Uzupełnij lampę o źródło światła E14 o mocy do 25 watów. Możesz przyciemnić tę lampę za pomocą zewnętrznego ściemniacza. Uwaga: źródło światła i ściemniacz nie są dołączone. Naprawdę fajna lampa do sypialni lub przedpokoju! Rozjaśnij swoje wnętrze dzięki kinkietowi Fringle!','','orientalny-kinkiet-zloty-z-zielonymi-fredzlami-fringle','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Orientalny kinkiet złoty z zielonymi frędzlami - Fringle','W magazynie','Dostępny','',''),(256,1,1,'Linc to prostokątny kinkiet wykonany z drewna. Idealnie komponuje się w wiejskim wnętrzu. Ma wysokość 11 cm, długość 37 cm i głębokość 11 cm. Kinkiet wyposażony jest w niewymienne oświetlenie LED o mocy 3000 kelwinów i 1800 lumenach. Duża liczba lumenów sprawia, że jest to prawdziwa potęga i doskonale nadaje się do wykorzystania jako funkcjonalny punkt świetlny. Średnio lampa wytrzymuje 30 000 godzin palenia. Jeśli chcesz stworzyć dodatkową atmosferę w swoim domu, możesz przyciemnić tę lampę w trzech krokach za pomocą przełącznika. Jeśli raz naciśniesz włącznik światła, uzyskasz 100% światła (tj. pełne). Po ponownym naciśnięciu otrzymujesz 60% światła, a za trzecim razem 30% światła (światło atmosferyczne). Ta wiejska lampa ścienna nadaje się do salonu, przedpokoju lub sypialni i na pewno nie powinno jej zabraknąć w Twoim wnętrzu!','','kinkiet-wiejski-39-cm-z-sciemniaczem-led-linc','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Kinkiet wiejski 39 cm z ściemniaczem LED - Linc','W magazynie','Dostępny','',''),(257,1,1,'Wielofunkcyjny kinkiet, ten Flero. Ta lampa jest wykończona metalową czernią ze złączem USB do ładowania tabletu i / lub smartfona! Bardzo funkcjonalny i ponadc