y kwiaty - Brescia','W magazynie','Dostępny','',''),(260,1,1,'Tyne to super fajna lampa ścienna pochodząca z industrialnego loftu! Brązowy kolor w połączeniu z czarnym ramieniem harmonijki dopełnia to naprawdę. Tyne ma wysokość 22 cm i długość 55 cm. Posiada regulację wysokości, od 43 cm do 55 cm. Możesz więc sam zdecydować, gdzie chcesz mieć światło. Super poręczne! Płyta montażowa ma głębokość 3,5 cm, wysokość 22 cm i szerokość 5,7 cm. Ten artykuł jest dostarczany z przewodem (185 cm) i wtyczką. Kinkiet jest dostarczany bez źródła światła, więc wykończ go solidnym źródłem światła, które pasuje do oprawy E27 o maksymalnej mocy 40 W. Ten Tyne świetnie pasuje do Twojej industrialnej kuchni, salonu czy przedpokoju!','','kinkiet-przemyslowy-braz-z-czarnym-tyne','Meta description-Oblongue, Organiczny','Meta keywords-Oblongue, Organiczny','Meta title-Oblongue, Organiczny','Kinkiet przemysłowy brąz z czarnym - Tyne','W magazynie','Dostępny','',''),(261,1,1,'Nasza lampa ścienna Cascada doskonale sprawdza się nad lustrem w łazience! Dzięki prostemu kształtowi i świeżemu wykończeniu z tworzywa sztucznego ze stalą lampa stanowi zabawny akcent. Posiada zintegrowany moduł LED o mocy 1750 lumenów i 3000 kelwinów; ten kinkiet zapewnia ciepłe, białe światło w łazience. Idealny, aby przygotować się na cały dzień! Uwaga: tej lampy nie można ściemniać i dlatego naprawdę nadaje się do użytku funkcjonalnego. Przy średnio 30 000 godzinach palenia możesz na razie zrobić dobre postępy z Cascadą. Lampa ma długość 92 cm, głębokość 7,2 cm i wysokość 5 cm. Z IP44 odporny na rozbryzgi wody. Zabawna lampa w łazience!','','nowoczesny-kinkiet-lazienkowy-czarny-92-cm-ip44-cascada','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesny kinkiet łazienkowy czarny 92 cm IP44 - Cascada','W magazynie','Dostępny','',''),(262,1,1,'Vintage kinkiet w kolorze mosiądzu z wykończeniem ze szkła dymnego. Uzupełnij swój hol lub sypialnię tym romantycznym kinkietem Vidra. Mosiądz / 