,2 cm i wysokość 5 cm. Z IP44 odporny na rozbryzgi wody. Zabawna lampa w łazience!','','nowoczesna-kinkiet-lazienkowy-czarny-62-cm-ip44-cascada','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesna kinkiet łazienkowy czarny 62 cm IP44 - Cascada','W magazynie','Dostępny','',''),(273,1,1,'Jeśli szukasz unikalnej lampy ściennej, która naprawdę doda coś do Twojego wnętrza, ta Disque jest prawdopodobnie dla Ciebie! Ta wyjątkowa okrągła lampa ścienna o średnicy 30 cm zapewnia piękne światło w wybranej przestrzeni życiowej. Dzięki temu przyciągającemu wzrok samemu musisz zamówić źródło światła E27! Jest to łatwe w naszym sklepie internetowym. Zdobądź teraz Disque i dopełnij wnętrze!','','nowoczesna-lampa-scienna-zlota-30-cm-disque','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa ścienna złota 30 cm - Disque','W magazynie','Dostępny','',''),(274,1,1,'Kompaktowa i uniwersalna lampa ścienna Caja zapewnia atrakcyjny wizerunek w Twoim domu lub biurze. Dzięki otworom po obu stronach na ściany rzuca się piękne światło. Lampa jest dostarczana z diodą LED. Dioda LED ma strumień świetlny 400 lumenów, dochodzi do 3000 kelwinów i ma moc 6. Lampa ma głębokość 12,6 cm, wysokość 9,7 cm, długość 9,7 cm i szerokość 9,7 cm. Płyta montażowa ma długość 8,5 cm i szerokość 8,5 cm. Dzięki połączeniu czerni i złota Caja zapewnia luksusowy wygląd w Twoim domu lub biurze.','','designerska-lampa-scienna-czarno-zlota-w-tym-led-caja','Meta description-Kwadratowy, Sześcian','Meta keywords-Kwadratowy, Sześcian','Meta title-Kwadratowy, Sześcian','Designerska lampa ścienna czarno-złota w tym LED - Caja','W magazynie','Dostępny','',''),(275,1,1,'Kinkiet Tableau to doskonała propozycja dla osób gustujących w nowoczesnym designie.\n\nElastyczne ramię pozwala skierować światło tam, gdzie jest to najbardziej potrzebne.\n\nLampa wyposażona została w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej (3000K) na