\nKinkiet Notia będzie prawdziwą ozdobą Twojego wnętrza!','','designerski-kinkiet-zloty-led-sciemniacz-dotykowy-notia','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerski kinkiet złoty LED ściemniacz dotykowy - Notia','W magazynie','Dostępny','',''),(280,1,1,'Kinkiet Facil to idealny wybór dla każdego miłośnika minimalistycznych i nowoczesnych rozwiązań.\n\nCałkowita wysokość (bez żarówki): 8.5 cm\n\nŚrednica płytki montażowej: 6.6 cm\n\nOdległość od ściany: 13 cm\n\nW komplecie źródło światła: E27 G125 7W 400lm 1800-3000K\n\nPobierz aplikację LUEDD na smartfon lub tablet.\n\nAplikacja działa tylko przez WiFi. Jest kompatybilna również z Amazon Alexa i Google Home.\nAplikacja daje Ci również możliwość kontroli pozostałych żarówek kompatybilnych z LUEDD.\n\nSprawdź pozostałe lampy z kolekcji Facil!','','industrialny-kinkiet-czarny-zarowka-wifi-e27-g125-facil','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Industrialny kinkiet czarny żarówka WiFi E27 G125 - Facil','W magazynie','Dostępny','',''),(281,1,1,'Piękny, biały kinkiet wykonany z gipsu, który oświetla ścianę zarówno od dołu, jak i od góry. Jako oświetlenie podstawowe ten kinkiet to doskonały wybór. Zawsze dobry w każdym wnętrzu dzięki ponadczasowemu i modnemu designowi. Lampy Tjada Novo 2 mają głębokość i wysokość 7,8 cm oraz długość 21,8 cm. Kinkiet jest dostarczany bez źródeł światła, które możesz łatwo wyregulować w naszym sklepie internetowym. Upewnij się, że wybrałeś dwa z mocowaniem G9 i maksymalnie 25 W. Możesz przyciemnić lampę wieczorem za pomocą zewnętrznego ściemniacza, aby uzyskać dodatkową atmosferę. To nie jest wliczone w cenę. Zacznij tutaj od nowoczesnego, designerskiego lub wiejskiego wyposażenia domu lub biura dzięki Tjada Nova.','','nowoczesny-kinkiet-bialy-2-punktowy-tjada-novo','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesny kinkiet biały 2-punktowy - Tjada Novo','W magazynie','Dostępny','',''),(282,1,1,'Elegancki kinkiet Athens Wire idealnie wpasowuje się zarówno w styl klasyczny jak i nowoczesny. Ponadto, połączenie czerni i złota nadaje lampie szyku. \n\nŚrednica płytki montażowej: 12 cm\n\nWysokość: 41 cm\n\nDługość: 23 cm\n\nŚrednica klosza: 10 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 2 x 28W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 2 gwinty na G9.\n\nKinkiet Athens Wire sprawi, że Twoje wnętrze nabierze charakteru. Świetnie sprawdzi się w kuchni, salonie, sypialni lub w przedpokoju.\n\nW serii Athens Wire znajdziesz bogaty wybór lamp!','','kinkiet-art-deco-czarny-klosz-zloty-2-zrodla-swiatla-athens','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Kinkiet art deco czarny klosz złoty 2-źródła światła - Athens','W magazynie','Dostępny','',''),(283,1,1,'Kinkiet Brescia pełni funkcję zarówno dekoracyjną, jak i praktyczną. Kreuje klimat, dodając aranżacji przytulności. \n\nKinkiet wyposażony jest w dwa niezależne źródła światła.\n\nElastyczne ramię wyposażone w zintegrowaną diodę LED pozwala skierować światło w dowolną stronę, dzięki czemu idealnie sprawdzi się jako lampka do czytania. \n\nKlasyczny klosz nadaje lampie elegancji i ponadczasowego charakteru. \n\nCałkowita wysokość: 42 cm\n\nOdległość od ściany: 21 cm\n\nWymiary płytki montażowej: 10 x 10 cm\n\nWysokość klosza: 14 cm\n\nŚrednica klosza: 18 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Wyposażona jest w gwint na E27 o maksymalnym poborze mocy 60W oraz w zintegrowaną diodę LED, która emituje światło o barwie ciepło białej (3000K) na poziomie 120 lumenów.\n\nKinkiet Brescia świetnie sprawdzi się jako oświetlenie pośrednie w sypialni lub salonie.','','kinkiet-art-deco-stal-klosz-welurowy-kwiaty-brescia','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Kinkiet art deco stal klosz welurowy kwiaty - Brescia','W magazynie','Dostępny','',''),(284,1,1,'Lampa Naesehorn natychmiast przyciągnie całą uwagę, gdy zostanie umieszczona w Twoim domu. Na rogu trzyma oprawę/źródło światła, za pomocą którego wnosi do Twojego wnętrza piękne światło i atmosferę. Lampy Animal stają się prawdziwym trendem, doskonale wpisują się w botaniczny i vintage styl życia. Ta ładna złota/mosiężna lampa ścienna wykonana z aluminium i stali ma głowę nosorożca z pięknie szczegółową twarzą. Nadaj swojemu wnętrzu dodatkowy akcent dzięki tej modnej lampie ściennej. Lampa nosorożca waży 1,1 kg i jest łatwa do zamocowania. Ma długość 12,5 cm, wysokość 34 cm i głębokość 19 cm. Lampa ma dużą oprawkę E27 i jest dostarczana bez źródła światła, więc koniecznie zamów ją razem z nią (maks. 25 Watt). Źródło światła jest widoczne w tej lampie, więc wybierz efektowny wariant, taki jak żarnikowe źródło światła LED. Możesz również przyciemnić lampę za pomocą zewnętrznego ściemniacza, aby uzyskać jeszcze więcej atmosfery. Daj mu ładne miejsce na swojej ścianie.','','vintage-kinkiet-mosiadz-naesehorn','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Vintage kinkiet mosiądz - Naesehorn','W magazynie','Dostępny','',''),(285,1,1,'Czy industrialny styl życia jest całkowicie twoją rzeczą? W takim razie kinkiet Paleta Mai dopełnia go! Drewno z czarnymi detalami lampy sprawia, że lampa ta jest naprawdę fajnym dodatkiem do Twojego wnętrza. Lampa ma długość 28,5 cm, wysokość 20 cm i głębokość 10,5 cm. Płyta montażowa ma długość 20,5 cm, wysokość 12 cm i głębokość 2 cm. Uzupełniasz kinkiet dwoma źródłami światła E27 o maksymalnej mocy 40 W. każde. Lampę można przyciemnić zewnętrznym ściemniaczem. Ściemniacz i źródła światła nie są dołączone. Kinkiet doskonale sprawdzi się jako oświetlenie nastrojowe lub funkcjonalne jako lampka nocna lub kinkiet w przedpokoju! Czy jesteś gotowy, aby nadać swojemu domowi odrobinę industrialnego charakteru? W takim razie wybierz kinkiet Paleta Mai','','industrialny-kinkiet-czarny-z-drewnem-2-punktowy-paleta-mai','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Industrialny kinkiet czarny z drewnem 2-punktowy - Paleta Mai','W magazynie','Dostępny','',''),(286,1,1,'Ta piękna lampa stołowa Bliss z ciemnym przydymionym szkłem jest idealna do każdego wnętrza! Dzięki ciemnemu szkłu ta lampa ma świetny efekt świetlny. Lampa wyposażona jest w inteligentne źródło światła E27 (7 watów i średnio 15 000 godzin świecenia), którym możesz sterować za pomocą aplikacji na smartfonie lub inteligentnego asystenta domowego. Źródło światła ma łącznie 806 lumenów i 1800 do 3000 kelwinów i może być ustawione na dowolną żądaną barwę światła i natężenie światła. W ten sposób masz funkcjonalne światło, nastrojowe światło i podstawowe światło w jednej oprawie. Ideał! Szkło tej lampy Bliss ma lekki kształt z efektem lustra. To sprawia, że jest to trudne! Dzięki wysokości 35,1 cm i średnicy 17,1 cm Bliss jest idealną lampą stołową.Możesz umieścić ją na stole w jadalni, biurku, stoliku kawowym lub stoliku nocnym jako lampkę do czytania! Pobierz teraz ten kreator nastroju do swojego domu i dopełnij swoje wnętrze!','','inteligentna-designerska-lampa-stolowa-czarna-z-przydymionym-szklem-w-tym-wifi-a60-bliss','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Inteligentna designerska lampa stołowa czarna z przydymionym szkłem, w tym WiFi A60 - Bliss','W magazynie','Dostępny','',''),(287,1,1,'Stylowy okrągły klasyk, ten Milo 2! Pięknie wykończony szarym odcieniem i stalową podstawą. Lampa ma wysokość 26 cm i średnicę 12 cm. Podstawa ma średnicę 11 cm. Oprawa jest dostarczana z przewodem, którego długość wynosi 150 cm.  Milo 2 ma glinianą oprawkę E14 i jest dostarczany wyłącznie ze źródłem światła, więc upewnij się, że go zamówisz (maks. 25 Watów) i zapewnisz atmosferyczne światło w domu! Lampa jest również ściemnialna za pomocą zewnętrznego ściemniacza. Prawdziwy twórca atmosfery w domu w tym Milo 2!','','nowoczesna-lampa-stolowa-szara-ze-stala-milo-2','Meta description-Cylindryczny, Okrągły','Meta keywords-Cylindryczny, Okrągły','Meta title-Cylindryczny, Okrągły','Nowoczesna lampa stołowa szara ze stalą - Milo 2','W magazynie','Dostępny','',''),(288,1,1,'Czas na projekt w domu dzięki naszej lampie stołowej Spira! Kaptur ma spiralny kształt, dzięki czemu przyciąga wzrok w Twoim wnętrzu! Ma wysokość 80 cm i średnicę 30 cm. Dostarczony przewód ma 190 cm długości. Otwarta konstrukcja tworzy niepowtarzalny efekt świetlny w Twojej przestrzeni. Dlatego upewnij się, że masz uderzające źródło światła E27 o maksymalnej mocy 40 W. Uwaga: źródło światła nie jest dołączone do lampy. Możesz go przyciemnić za pomocą zewnętrznego ściemniacza (brak w zestawie). Umieść tę Spira w swojej sypialni jako lampkę nocną lub użyj jej jako nastrojowej lampy w salonie. Cokolwiek wolisz: dzięki tej lampie stołowej i tak stworzysz luksusowy wygląd!','','designerska-lampa-stolowa-czarna-spira','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerska lampa stołowa czarna - Spira','W magazynie','Dostępny','',''),(289,1,1,'Ta lampa stołowa to prawdziwy klejnot. Oprawa ma kolor brązu i jest wykończona białą nasadką, która nadaje tej lampie klasyczny wygląd. Konstrukcja ze stalowym i abażurowym materiałem nadaje tej lampie stołowej klasyczny wygląd. Lampa ma regulowaną wysokość od minimum 57 cm do maksymalnie 67 cm i ma kabel 180 cm. Na oprawie klosza znajduje się przycisk włączania i wyłączania, dzięki czemu lampa jest łatwa w obsłudze. Możesz zakończyć tę klasyczną lampę źródłem światła E27, które wciąż należy zamawiać osobno. Klasyczny klejnot, który doda Twojej przestrzeni dodatkowego uroku!','','klasyczna-lampa-stolowa-z-brazu-z-bialym-kloszem-ashley','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Klasyczna lampa stołowa z brązu z białym kloszem - Ashley','W magazynie','Dostępny','',''),(290,1,1,'Lampę stołową Parte charakteryzuj