ły','Meta title-Oblongue, Okrągły','Lampa stołowa czarna ze złotym statywem 63,3 cm regulowana - Magnax','W magazynie','Dostępny','',''),(292,1,1,'Ta wesoła lampa stołowa natychmiast wywoła uśmiech na Twojej twarzy. Monkey Hale przyciąga wzrok do salonu, biura lub sypialni. Z jego ogona zwisa oprawa/źródło światła, dzięki któremu wnosi do wnętrza piękne światło i atmosferę. Lampy Animal stają się prawdziwym trendem, doskonale wpisują się w botaniczny i vintage styl życia. Ta ładna czarna lampa stołowa wykonana z aluminium i stali ma kształt małpy o pięknie szczegółowej twarzy. Ta modna lampa stołowa ożywi Twoje wnętrze. Lampa Aap Hale waży 1,6 kg i jest dostarczana z przewodem (200 cm) i wtyczką z włącznikiem. Ma długość 17,5 cm, wysokość 41 cm i szerokość 12,5 cm. Stopa ma wysokość 2,5 cm, długość 17,5 cm i szerokość 12,5 cm. Ta lampa ma dużą oprawę E27 i jest dostarczana bez źródła światła, więc upewnij się, że zamawiasz ją razem z nią (maks. 25 Watt). Źródło światła jest widoczne w tej lampie, więc wybierz efektowny wariant, taki jak żarnikowe źródło światła LED. Możesz również przyciemnić lampę za pomocą zewnętrznego ściemniacza, aby uzyskać jeszcze więcej atmosfery. Daj mu ładne miejsce na przykład na kredensie lub stoliku. Lampa stołowa Monkey Hale doskonale sprawdzi się również w dziecięcym pokoju o tematyce dżungli!','','lampa-stolowa-vintage-czarna-monkey-hale','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Lampa stołowa vintage czarna - Monkey Hale','W magazynie','Dostępny','',''),(293,1,1,'Dzięki lampie stołowej Balenco Wazo natychmiast nadasz ton! Ta fajna lampa stołowa to idealna lampa do stworzenia nastrojowego lub podstawowego oświetlenia w Twoim domu. Uzupełnij tę lampę pięknym źródłem światła E27 o mocy do 40 watów. Możesz przyciemnić źródło światła zewnętrznym ściemniaczem. Źródło światła i ściemniacz nie są dołączone. Lampa ma długość 20 cm, szerokość 12 cm i wysokość 50 cm. Podstawa ma długość 20 cm, szerokość 12 cm i wysokość 0,