. Uzupełniasz lampę stołową o źródło światła z oprawą E27 (maks. 60 Watt). Upewnij się, że zamawiasz je osobno w sklepie internetowym. Oświetlenie można również ściemniać za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. VT 1 doskonale sprawdzi się na szafce nocnej, kredensie czy w salonie. W nowoczesnym wnętrzu czuje się jak w domu. Lampa stołowa VT 1 jest dokładnie tym, czego szukasz!','','nowoczesna-lampa-stolowa-abazur-z-tkaniny-czarny-ze-zlotem-vt-1','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa stołowa abażur z tkaniny czarny ze złotem - VT 1','W magazynie','Dostępny','',''),(307,1,1,'Miłośnicy minimalizmu zapewne zachwycą się naszą kolekcją lamp Bliss Vefa. \n\nSiatka nawiązująca do stylu industrialnego nie tylko nadaje lampie uroku i aury tajemniczości, ale po włączeniu sprawia, że emitowane światło tworzy piękny efekt światła i cienia.\n\nPolecamy zastosować dekoracyjną żarówkę, aby wzmocnić efekt.\n\nLampa Bliss Vefa posiada gwint na E27. Maksymalny pobór mocy wynosi 50W. Do lampy nie jest dołączone źródło światła. Takowe należy zakupić we własnym zakresie. \n\nŚrednica podstawy: 25 cm\n\nDługość przewodu z wtyczką: 200 cm\n\nŚrednica klosza: 16 cm\n\nCałkowita wysokość lampy: 40 cm\n\nKolekcja Bliss Vefa świetnie prezentować się będzie zarówno w surowych, przemysłowych wnętrzach, ale również w bardziej klasycznych i stonowanych aranżacjach.','','industrialna-lampa-stolowa-trojnog-czarna-40cm-bliss-vefa','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Industrialna lampa stołowa trójnóg czarna 40cm - Bliss Vefa','W magazynie','Dostępny','',''),(308,1,1,'Lampa stołowa Ann-Kathrin oznacza się ponadczasową klasyką okraszoną nowoczesnym wdziękiem. Pięknie wykonane ramiona, przyozdobione dekoracyjnymi elementami całkowicie wpisują się w założenia stylu glamour.\n\nŚrednica podstawy: 21 cm\n\nCałkowita wysokość: 66 cm\n\nŚrednica klosza: 40 cm\n\nWysokość klosza: 26 cm\n\nLampa s