'),(315,1,1,'Super ładne połączenie, czyli ta lampa stołowa i podłogowa Pip. Idealnie pasuje do Twojego biura lub salonu. Czarny kolor z drewnianymi nogami nadaje Twojemu domowi nowoczesny, miękki wygląd.  Lampa podłogowa ma wysokość 155 cm i ma 70 cm długości. Lampa stołowa (na przykład ładna na biurku) ma 56 cm wysokości, a klosz ma średnicę 30 cm.  Lampy można ściemniać (ściemniacz nie wchodzi w skład zestawu), aby stworzyć przytulną atmosferę w domu. Obie lampy mają dużą oprawkę E27 i są dostarczane bez źródeł światła, więc upewnij się, że nadal je zamawiasz.  Rozjaśnij swój dom dzięki tej lampie podłogowej i stołowej Pip!','','komplet-czarna-lampa-stolowa-i-podlogowa-z-kloszem-pip','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Komplet czarna lampa stołowa i podłogowa z kloszem - Pip','W magazynie','Dostępny','',''),(316,1,1,'Lampa przemysłowa z domieszką kraju. To najlepszy sposób na opisanie lampy stołowej Woodi. Lampa jest pięknie dopracowana. Jest tak praktyczny, jak piękny! Lampa stołowa ma zawiasową konstrukcję, dzięki czemu można wycelować ramię i pozwolić, aby światło świeciło tam, gdzie jest potrzebne. Lampa stołowa jest ściemnialna za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Lampa jest dość duża jak na lampę stołową, dzięki czemu przyciąga wzrok.  Niech twoja lampa stołowa Woodi zabłyśnie źródłem światła E14 (maks. 40 Watt); można to zamówić osobno. Drewniane detale sprawiają, że lampa ta jest wyjątkowa i całkowicie wykończona!  Lampa ma minimalną wysokość 36 cm i maksymalną wysokość 52 cm, długość 15,5 i szerokość 30 cm. Podstawa ma średnicę 15,5 cm. Wykończ swoje wnętrze lampą stołową Woodi.','','przemyslowa-lampa-stolowa-czarna-z-drewnem-woodi','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Przemysłowa lampa stołowa czarna z drewnem - Woodi','W magazynie','Dostępny','',''),(317,1,1,'Elegancka lampa stołowa Athens idealnie wpasowuje się zarówno w styl klasyczny jak 