Stopa ma średnicę 20 cm. Don jest dostarczany z przewodem (130 cm) i wtyczką. Lampa stołowa posiada zintegrowane oświetlenie LED o strumieniu świetlnym 600 lumenów i 3000 - 6000 kelwinów. Daje dużo białego światła. Oświetlenie można również ściemniać za pomocą przycisków na podstawie. Oświetlenie trwa średnio 25 000 godzin świecenia. Idealna lampa stołowa do biura, w gabinecie lub podczas czytania gazety. I to podczas ładowania telefonu. Don jest dokładnie tym, czego potrzebujesz!','','designerska-lampa-stolowa-szara-z-dioda-led-i-bezprzewodowa-ladowarka-don','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerska lampa stołowa szara z diodą LED i bezprzewodową ładowarką - Don','W magazynie','Dostępny','',''),(324,1,1,'Ta lampa stołowa Maly wygląda jak mała latarnia na Twoim stole lub kredensie i dzięki temu od razu tworzy wspaniałą atmosferę! Dzięki czarnemu wykończeniu i przydymionemu szkłu klosza lampa ta natychmiast nada Twojemu domowi nowoczesny charakter! Lampa ma 55 cm wysokości, 27,5 cm długości i 20 cm szerokości. Podstawa ma średnicę 18 cm. Uzupełnij tę lampę stołową pięknym źródłem światła E27 o mocy do 25 watów. Źródło światła nie jest wliczone w cenę. Jeśli chcesz przyciemnić tę lampę, możesz to zrobić za pomocą zewnętrznego ściemniacza, ale nie jest to dołączone. Do lampy dołączony jest przewód z wtyczką (200 cm). Nadaj swojemu wnętrzu nowoczesny wygląd dzięki lampie stołowej Maly! Zwróć uwagę! Maska tych produktów jest uszkodzona. Dlatego lampy Maly są obecnie wyjątkowo tanie w sklepie.','','nowoczesna-lampa-stolowa-czarna-ze-szklem-dymnym-maly','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa stołowa czarna ze szkłem dymnym - Maly','W magazynie','Dostępny','',''),(325,1,1,'Lubisz klasykę w nowoczesnym wydaniu? W takim razie kolekcja lamp Simplo jest stworzona właśnie z myślą o Tobie!\n\nKlasyczny klosz nadaje lampie elegancji i ponadczasowego charakteru.\n\nCałkowita wysokość: 52.5 cm\n\nWysokość (bez klosza): 39.5 cm\n\nŚrednica podstawy: 14 cm\n\nDługość kabla z wtyczką: 200 cm\n\nŚrednica klosza: 32 cm\n\nWysokość klosza: 18 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nSimplo to doskonała propozycja lampy stołowej dla osób gustujących w nowoczesnych minimalistycznych wnętrzach.','','lampa-stolowa-stal-klosz-bialy-32cm-simplo','Meta description-okrągły / ścięty stożek','Meta keywords-okrągły / ścięty stożek','Meta title-okrągły / ścięty stożek','Lampa stołowa stal klosz biały 32cm - Simplo','W magazynie','Dostępny','',''),(326,1,1,'Nasz bohater to szczególna designerska lampa stołowa. Dzięki białemu opalowemu żebrowanemu szkłu lampa ta zapewnia doskonałe miękkie światło. Musisz zamówić źródło światła E27 o maksymalnej mocy 60 watów. Lampę można również przyciemnić zewnętrznym ściemniaczem, aby stworzyć idealną atmosferę.  Zwróć uwagę na tego Bohatera: dzięki tej lampie pod oprawą są przymocowane dwa kołki, które musisz umieścić, aby prawidłowo zabezpieczyć szklany klosz. Te szpilki ostatecznie znikają w masce.  Dzięki wysokości 30 cm i średnicy 33 cm Hero jest lampą stołową o idealnych rozmiarach. Na przykład możesz użyć go na stole do jadalni, biurku, stoliku do kawy lub stoliku nocnym jako lampki do czytania! Lampa jest dostarczana z przewodem i wtyczką o długości 180 cm, dzięki czemu można ją łatwo włączyć / wyłączyć. Pobierz teraz ten kreator atmosfery i dopełnij wnętrze!','','designerska-lampa-stolowa-czarna-mleczne-szklo-33-cm-hero','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerska lampa stołowa czarna mleczne szkło 33 cm - Hero','W magazynie','Dostępny','',''),(327,1,1,'Lampa stołowa Magnax przyciąga wzrok do Twojego domu! Na zewnątrz czarny, wewnątrz złoty, tworząc przytulny efekt świetlny w salonie lub sypialni. Lampa ma wysokość 39,2 cm, długość 40,5 cm i szerokość 35 cm. Klosz ma średnicę 35 cm i wysokość 15 cm. Podstawa ma średnicę 10 cm. Upewnij się, że masz ładne źródło światła w oprawie, aby lampa wychodziła jeszcze lepiej! Źródło światła musi mieć oprawę E27 (maks. 60 W), aby pasowało do oprawy.  Możesz wyregulować Magnax przy kapturze, aby określić, gdzie światło powinno świecić w pomieszczeniu. Bardzo przydatne!  Aby stworzyć dodatkową atmosferę, możesz podłączyć lampę do ściemniacza, nie jest to dołączone. Ten artykuł jest dostarczany ze sznurkiem (160 cm). Stylowy dodatek do Twojego domu? Czek!','','przemyslowa-lampa-stolowa-czarna-ze-zlotem-regulowana-392-cm-magnax','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Przemysłowa lampa stołowa czarna ze złotem regulowana 39,2 cm - Magnax','W magazynie','Dostępny','',''),(328,1,1,'Lampę stołową Parte charakteryzuje prostota i minimalizm.\n\nRegulowana wysokość oraz włącznik światła na trzonku są niekwestionowanym atutem tej lampy.\n\nKlasyczny welurowy klosz nadaje lampie elegancji i ponadczasowego charakteru, a złote wnętrze sprawia, że emitowane światło jest ciepłe i nastrojowe.\n\nWysokość regulowana w zakresie (bez klosza): 59-74 cm\n\nWysokość regulowana w zakresie (z kloszem): 45-61 cm\n\nŚrednica podstawy: 14 cm\n\nŚrednica klosza: 25 cm\n\nWysokość klosza: 25 cm\n\nDługość kabla z wtyczką: 180 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nParte to doskonała propozycja lampy stołowej dla osób gustujących w nowoczesnych minimalistycznych wnętrzach.','','lampa-stolowa-regulowana-zlota-mosiadz-klosz-welurowy-niebieski-25cm-parte','Meta description-Cylindryczny, Oblongue, Okrągły','Meta keywords-Cylindryczny, Oblongue, Okrągły','Meta title-Cylindryczny, Oblongue, Okrągły','Lampa stołowa regulowana złota/mosiądz klosz we