 ma całkowitą wysokość 47 cm. Produkt dostarczany jest z przewodem i wtyczką o długości 160 cm. Podstawa lampy ma średnicę 13 cm. Lampa, która wytrzymuje do 20 000 godzin palenia przez długi czas. Ta Paulina ma dwa punkty świetlne ze zintegrowaną diodą LED. Dzięki 580 lumenom i 3000 kelwinów zapewnia jasne, białe światło w całym wnętrzu. Poręczna na przykład jako funkcjonalna lampka do czytania. Możesz go przyciemnić za pomocą ściemniacza dotykowego na urządzeniu. Ma trzy tryby: błyskawicznie przechodzi od funkcjonalnego światła roboczego do nastrojowego oświetlenia! Ciesz się więc Pauliną w każdej sytuacji. Wybierz stylową lampę stołową w swoim biurze lub salonie!','','designerska-lampa-stolowa-stal-led-dotykowa-sciemnialna-paulina','Meta description-Organiczny','Meta keywords-Organiczny','Meta title-Organiczny','Designerska lampa stołowa stal LED dotykowa ściemnialna - Paulina','W magazynie','Dostępny','',''),(341,1,1,'Lampa stołowa Tableau to doskonała propozycja dla osób gustujących w nowoczesnym designie.\n\nElastyczne ramię pozwala skierować światło tam, gdzie jest to najbardziej potrzebne.\n\nLampa wyposażona została w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej (3000K) na poziomie 380 lumenów. Dioda ta uzyskała klasę energetyczną A+, co oznacza, że jest nie tylko energooszczędna, ale zapewnia profity i dla Twojego portfela i dla środowiska. Wbudowany moduł LED gwarantuje 20 000 godzin świecenia. \n\nPonadto, lampa jest ściemnialna.\n\nCałkowita wysokość: 38 cm\n\nLampa stołowa Tableau będzie nie tylko praktycznym dodatkiem emitującymi funkcjonalne światło, ale również ozdobą każdego pomieszczenia.','','lampa-stolowa-art-deco-braz-led-tableau','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Lampa stołowa art deco brąz LED - Tableau','W magazynie','Dostępny','',''),(342,1,1,'Klasyczna lampa stołowa Rich składa się z metalowego stelażu i materiałowego klosza na niego nasadzonego. \n\nCiekawa konstruk