integrowaną diodę LED i nie jest wymienna. Ta dioda LED ma strumień świetlny 300 lumenów i 3000 kelwinów, co oznacza, że świeci funkcjonalnym światłem. Przydatny w kąciku do czytania. Ten Douwe ma nie mniej niż 20 000 godzin palenia i dlatego trwa długo. Bardzo miłym dodatkiem do tej lampy stołowej jest możliwość ściemniania ściemniaczem dotykowym. Ten ściemniacz znajduje się na górze pręta (biały przycisk). Naciskasz raz, aby go włączyć i tak dochodzi do jego najostrzejszego ustawienia. Gdy przytrzymasz przycisk, powoli się ściemni. Spraw, aby wieczorem było wyjątkowo przytulnie, przyciemniając światło! Wbudowane ramię do czytania jest regulowane, dzięki czemu możesz wybrać sposób zginania ramienia do czytania. Metalowe wykończenie w połączeniu z eleganckim designem zapewnia super nowoczesny wygląd! Krótko mówiąc, zdjęcie do obejrzenia.','','nowoczesna-lampa-stolowa-stal-z-dotykowa-sciemnialna-zawiera-led-douwe','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna lampa stołowa stal z dotykowa ściemnialna zawiera LED - Douwe','W magazynie','Dostępny','',''),(347,1,1,'Lampę stołową Regina wyróżnia prosty design i klasyczna forma. Wspaniale prezentuje się zarówno w sypialni, jak i w salonie. \n\nWysokość lampy: 24 cm\n\nŚrednica podstawy: 11 cm\n\nDługość kabla z wtyczką: 140 cm\n\nLampa stołowa Regina wyposażona została w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej 3000K na poziomie 200 lumenów! \nWbudowany moduł LED gwarantuje 30 000 godzin świecenia. \n\nPonadto, lampa jest ściemnialna. Może pracować w 3 trybach: 100%, 60% i 30% mocy emitowanego światła.\n\nLampę stołową Regina wyróżnia ponadczasowy charakter i funkcjonalność! Na pewno sprawdzi się u Ciebie!','','designerska-lampa-stolowa-zlota-led-3-stopniowe-sciemnianie-regina','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Designerska lampa stołowa złota LED 3-stopniowe ściemnianie - Regina','W magazynie','Dostępny',''