 12,5 cm. Stopa ma wysokość 2,5 cm, długość 18 cm i szerokość 12,5 cm. Hjort Tre jest dostarczany z przewodem (200 cm) i wtyczką. Wykończ lampę stołową źródłem światła z oprawką E27 (maks. 25 Watt). Nie zapomnij zamówić ich osobno. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Rozświetl swoje wnętrze lampą stołową Hjort Tre!','','lampa-stolowa-vintage-mosiezna-hjort-tre','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Lampa stołowa vintage mosiężna - Hjort Tre','W magazynie','Dostępny','',''),(420,1,1,'Nadaj swojemu wnętrzu zabawny akcent dzięki lampie stołowej Cage Abe. Fajną rzeczą w tej lampie jest to, że wygląda, jakby małpa była w klatce i określa, kiedy zapala się światło. Oczywiście zawsze możesz to zrobić samodzielnie za pomocą włącznika na przewodzie (200 cm). Lampa wykonana jest z aluminium wraz ze stalą i plastikiem. Stojak wykończony jest w kolorze czarnym, a małpka w mosiądzu. Daje to ładny kontrast, a lampa idealnie pasuje do wnętrza nowoczesnego lub vintage. Cage Abe ma całkowitą wysokość 45,75 cm, długość 15,2 cm i szerokość 15,3 cm. Stopa ma wysokość 4 cm. Lampę stołową uzupełniasz zamawiając źródło światła z oprawą E27 (maks. 25 Watt). Jeśli chcesz stworzyć dodatkową atmosferę w pomieszczeniu, możesz podłączyć lampę do ściemniacza (brak w zestawie). Ta ładna lampa podłogowa doskonale sprawdzi się w salonie, gabinecie lub sypialni. Rozjaśnij swoje wnętrze starą lampą podłogową Cage Abe.','','vintage-lampa-stolowa-mosiadz-z-czarnym-cage-abe','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Vintage lampa stołowa mosiądz z czarnym - Cage Abe','W magazynie','Dostępny','',''),(421,1,1,'Ten Joni może być używany na kilka sposobów. Możesz go używać jako lampy stołowej, ale także jako kinkiet. Jego szyja jest łatwa do regulacji, ponieważ jest bardzo elastyczna. Super poręczny! Ta lampa wykonana jest z aluminium z tworzywem sztucznym i wykończona jest w kolorze białym. Ma wysok