 (200 cm) i wtyczką. Uzupełniasz Banci o źródło światła, które ma oprawę E27 (maks. 25 W). Nie zapomnij zamówić ich osobno. Lampę można ściemniać za pomocą zewnętrznego ściemniacza, który nie jest dołączony. Banci to idealny stół do kredensu, stolika nocnego lub po prostu na stole w jadalni. Uatrakcyjnij swoje wnętrze dzięki lampie stołowej Banci!','','lampa-stolowa-art-deco-czarna-ze-szklem-dymnym-banci','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Lampa stołowa Art Deco czarna ze szkłem dymnym - Banci','W magazynie','Dostępny','',''),(424,1,1,'Cóż za wesoła lampa stołowa Johanna! Swoim kształtem przypomina drzewo, ale w stylowej kurtce. Lampa wykonana jest ze stali i wykończona w kolorze czarnym. Listwy zawieszone nad źródłem światła w kształcie kuli zapewniają przytulny efekt świetlny w pomieszczeniu. Johanna ma średnicę 20 cm i wysokość 40 cm. Podstawa ma średnicę 15 cm i wysokość 2,5 cm. Stalowy klosz ma średnicę 20 cm i wysokość 15 cm. Dołączony do lampy przewód ma długość 200 cm. Źródło światła, w którym uzupełniasz lampę, ma oprawę E27 (maks. 40 Watt). Więc nie zapomnij zamówić ich osobno. Wybierz źródło światła, które również ładnie wygląda, ponieważ jest wyraźnie widoczne w oprawie. Lampę stołową można przyciemnić po podłączeniu do ściemniacza (brak w zestawie). Johanna to idealna lampa stołowa do kredensu, stolika nocnego lub do pokoju dziecinnego. Spraw, by Twoje wnętrze było stylowe z Johanną!','','designerska-lampa-stolowa-czarna-johanna','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerska lampa stołowa czarna - Johanna','W magazynie','Dostępny','',''),(425,1,1,'Brak opisu','','moderne-tafellamp-zwart-met-kap-rood-25-cm-simplo','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Moderne tafellamp zwart met kap rood 25 cm - Simplo','W magazynie','Dostępny','',''),(426,1,1,'Brak opisu','','moderne-tafellamp-zwart-met-kap-grijs-25-cm-simplo','Meta descripti