y','',''),(429,1,1,'Czy jesteś gotowy na odrobinę atmosfery w swoim ogrodzie? Z naziemnym miejscem Delux wszystko będzie w porządku. Ustaw kilka punktów obok siebie przy ścieżce w ogrodzie, na podjeździe lub na tarasie i ciesz się nastrojowym oświetleniem. Spot wykonany jest ze stali nierdzewnej z dodatkiem tworzywa sztucznego i szkła, wykończony w kolorze czarnym. Ma średnicę 13 cm. Szkło ma średnicę 8,7 cm. Rozmiar instalacji to 12,6 cm średnicy i 14,5 cm głębokości. Kończysz Delux źródłem światła z oprawą GU10 (maks. 50 Watt). Dzięki wartości IP IP65, spot jest bryzgoszczelny. Psst, czy kiedykolwiek pomyślałeś o tym miejscu w łazience, to naprawdę daje luksusowy wygląd. Delux można ściemniać za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Dodaj więcej atmosfery do swojego ogrodu dzięki punktowi naziemnemu Delux.','','nowoczesna-zewnetrzna-lampa-punktowa-czarna-ip65-delux','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna zewnętrzna lampa punktowa czarna IP65 - Delux','W magazynie','Dostępny','',''),(430,1,1,'Ten solidny kinkiet jest dla śmiałków. Charlois to dwupłatowiec z nie mniej niż dwoma źródłami światła, co sprawia, że wyglądają jak lustrzane odbicie. Wykonany jest z czarnego aluminium z plastikiem i ma przezroczyste panele z boku. Dodając ładne źródło światła, przyciągasz wzrok! Lampa ma głębokość 13,5 cm, wysokość 38 cm i długość 14 cm. Płyta montażowa ma głębokość 2,5 cm, wysokość 20 cm i długość 9 cm. Uzupełniasz Charlois dwoma źródłami światła, każde z oprawą E27 (maks. 40 W), które nadal musisz zamówić osobno. Lampę można ściemniać za pomocą zewnętrznego ściemniacza, który nie jest dołączony. Lampa ma wartość IP IP44, dzięki czemu jest bryzgoszczelna. Charlois to idealna lampa ścienna do drzwi wejściowych, altanki czy lustra w łazience!','','przemyslowy-kinkiet-czarny-38-cm-2-punktowy-ip44-charlois','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Przemysłowy kinkiet czarny 38 cm 2-punktowy IP44 - Charlois','W magazynie','Dostępny','',''),(431,1,1,'Nowoczesny kinkiet Duo wyróżnia unikatowy design i najwyższa jakość wykonania. \n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu. \n\nWysokość: 21.5 cm\n\nOdległość od ściany: 11 cm\n\nKinkiet Duo jest gotowy do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 35W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Zalecamy użycie żarówki LED. Oprawa wyposażona jest w 2 gwinty na GU10. \n\nPonadto, kinkiet Duo wyposażony został w czujnik zmierzchu, co oznacza, że automatycznie włącza się po zapadnięciu zmierzchu i wyłącza kiedy robi się widno.\n\nKinkiet Duo idealnie sprawdzi się do oświetlenia elewacji, tarasu, drzwi wejściowych czy garażu.','','kinkiet-zewnetrzny-czarny-ip44-z-czujnikiem-zmierzchu-duo','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Kinkiet zewnętrzny czarny IP44 z czujnikiem zmierzchu - Duo','W magazynie','Dostępny','',''),(432,1,1,'Nowoczesny kinkiet Duo wyróżnia unikatowy design i najwyższa jakość wykonania. \n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu. \n\nWysokość: 21.5 cm\n\nOdległość od ściany: 11 cm\n\nKinkiet Duo jest gotowy do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 35W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Zalecamy użycie żarówki LED. Oprawa wyposażona jest w 2 gwinty na GU10. \n\nPonadto, kinkiet Duo wyposażony został w czujnik zmierzchu, co oznacza, że automatycznie włącza się po zapadnięciu zmierzchu i wyłącza kiedy robi się widno.\n\nKinkiet Duo idealnie sprawdzi się do oświetlenia elewacji, tarasu, drzwi wejściowych czy garażu.','','kinkiet-zewnetrzny-antracyt-ip44-z-czujnikiem-zmierzchu-duo','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Kinkiet zewnętrzny antracyt IP44 z czujnikiem zmierzchu - Duo','W magazynie','Dostępny','',''),(433,1,1,'Nowoczesna lampa zewnętrzna. Trzon lampy wykonany został z aluminium pokrytego poliestrową powłoką proszkową i zakończony przezroczystym kloszem z tworzywa sztucznego. Denmark pięknie oświetli elewację budynku.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 17 cm\n\nWymiary lampy: 8.5 x 8.5 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 13W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nLampy z serii Denmark emitują przyjemne, klimatyczne światło.\n\nSeria Denmark idealnie sprawdzi się w Twoim ogrodzie!\n\n\nUwaga: Może tymczasowo występować zjawisko kondensacji pary wodnej. Jest to normalne i wszystkie lampy zewnętrzne zostały zaprojektowane, by radzić sobie z tym problemem. Kondensacja zazwyczaj ustępuje po pewnym czasie od jej włączenia.','','przemyslowy-kinkiet-zewnetrzny-rdzawobrazowy-ip44-denmark','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Przemysłowy kinkiet zewnętrzny rdzawobrązowy IP44 - Denmark','W magazynie','Dostępny','',''),(434,1,1,'Prosta i ponadczasowa lampa zewnętrzna Solo sprawdzi się do oświetlenia krzewów, drzew i kwietników.\n\nReflektor jest regulowany za pomocą przegubu kulowego, dzięki któremu możesz zdecydować o kierunku padania emitowanego światła.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu. \n\nWysokość: 28 cm\n\nŚrednica reflektora: 6 cm\n\nDługość przewodu: 240 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 35W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na GU10. \n\nSprawdź pozostałe lampy z rodziny Solo!','','spot-z-klinem-antracyt-regulowany-ip44-solo','Meta description-Cylindryczny','Meta keywords-Cylindryc