,'Dostępny','',''),(445,1,1,'Solidny i prosty nowoczesny kinkiet zewnętrzny wykończony kloszem ze stali nierdzewnej i tworzywa sztucznego. Sfera jest mocna i trwała, dzięki czemu jest idealną lampą ścienną do każdego miejsca w ogrodzie lub na zewnątrz, aby stworzyć atmosferę. Ten kinkiet ma niewielkie rozmiary, ma całkowitą wysokość 36,9 cm i głębokość 27 cm. Lampa posiada IP44, dzięki czemu idealnie nadaje się do użytku na zewnątrz! Kończysz lampę źródłem światła z oprawą E27 (maks. 40 Watt), którą należy zamówić osobno. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Rozświetl swoją ścianę zewnętrzną za pomocą Sfery!','','kinkiet-zewnetrzny-czarny-z-plastikiem-ip44-stal-nierdzewna-sfera','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Kinkiet zewnętrzny czarny z plastikiem IP44 stal nierdzewna - Sfera','W magazynie','Dostępny','',''),(446,1,1,'Piękne miejsce na ziemi dobrej jakości z ciężką osłoną ze stali nierdzewnej. Ten punkt naziemny ma uchylne wnętrze, dzięki czemu światło może być skierowane z ziemi. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Lampa ma średnicę 13 cm. Wymiary montażowe tego spotu: średnica 12,6 cm i głębokość 14,5 cm. Punkt jest dostarczany z kablem o długości ok. 30 cm, który należy wodoszczelnie połączyć z przewodem uziemiającym. Miejsce można również przejechać (można przejechać samochodem). Uzupełniasz lampę o źródło światła GU10 o mocy maks. 50. To źródło światła można zamówić osobno. Delux jest bryzgoszczelna, dzięki czemu jest idealną lampą do użytku na zewnątrz. Teraz jeszcze taniej w zestawie 5 sztuk!','','zestaw-5-x-oprawa-do-wbudowania-stal-ip65-delux','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Zestaw 5 x oprawa do wbudowania stal IP65 - Delux','W magazynie','Dostępny','',''),(447,1,1,'Prosty i ponadczasowy kinkiet Solo zapewni idealne podświetlenie elewacji budynku.\n\nPo