o zapadnięciu zmierzchu i wyłącza kiedy robi się widno.\n\nKinkiet Emmerald świetnie sprawdzi się jako oświetlenie elewacji, balkonu czy tarasu.','','kinkiet-zewnetrzny-stal-czujnik-zmierzchu-ip44-emmerald','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny stal czujnik zmierzchu IP44 - Emmerald','W magazynie','Dostępny','',''),(452,1,1,'Nowoczesny plafon zewnętrzny Rotterdam pięknie oświetli taras, ganek bądź wejście do domu. \n\nPosiada stopień ochrony IP23, który zapewnia bezpieczną pracę lampy w deszczu.\n\nCałkowita wysokość: 22.5 cm\n\nDługość: 16 cm\n\nWymiary przysyfitki: 12 x 12 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27.\n\nZalecamy użycie dekoracyjnej żarówki, która podkreśli charakter lampy.\n\nSeria Rotterdam idealnie sprawdzi się jako oświetlenie na tarasie i w ogrodzie!','','industrialny-plafon-zewnetrzny-czarny-rotterdam','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Industrialny plafon zewnętrzny czarny - Rotterdam','W magazynie','Dostępny','',''),(453,1,1,'Solidna i prosta nowoczesna lampa zewnętrzna ze stali nierdzewnej, czyli Sfera. Kula idealnie pasuje do nowoczesnego środowiska. Plastikowy sferyczny klosz ma kolor biały, dzięki czemu światło jest pięknie rozprowadzane. Naprawdę przyciąga wzrok do ogrodu! Przy wartości IP IP44 woda rozbryzgowa jest zamknięta.  Czapka Sfery ma średnicę 25 cm. Słup ma wysokość 50 cm. Lampa ma dużą oprawkę E27 i jest dostarczana bez źródła światła, więc upewnij się, że nadal ją zamawiasz (maks. 60 Watt). Aby jeszcze bardziej cieszyć się wieczorem, lampa ta może być również ściemniana (ściemniacz nie jest dołączony).  Rozświetl swój ogród lub taras dzięki Sferze!','','nowoczesna-lampa-zewnetrzna-slup-stal-nierdzewna-50-cm-sfera','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna lampa zewnętrzna słup stal nierdzewna 50 cm - Sfera','W magazynie','Dostępny','',''),(454,1,1,'Szukasz klasycznej czarnej latarni? Wtedy znalazłeś to w latarni New Orleans wykonanej z aluminium ze szklanymi taflami! Możesz zobaczyć vintage design na wszystkich krzywiznach i wdzięcznym wykończeniu. Stojąca lampa zewnętrzna ma sześć przezroczystych diamentów, dzięki czemu źródło światła jest dobrze widoczne, więc wybierz piękną żarówkę. Ta latarnia ma średnicę 20 cm i wysokość 120 cm. Lampa ma dużą oprawę E27 i jest dostarczana bez źródła światła, więc upewnij się, że ją z nią zamawiasz (maks. 60 W). Możesz umieścić tę latarnię w swoim ogrodzie, również ładnie z kilkoma obok siebie wzdłuż ścieżki ogrodowej. Dzięki tej klasycznej ściemnianej lampie New Orleans naprawdę dodasz stylu swojemu ogrodowi.','','latarnia-zewnetrzna-stojaca-czarna-120-cm-ip44-nowy-orlean','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Latarnia zewnętrzna stojąca czarna 120 cm IP44 - Nowy Orlean','W magazynie','Dostępny','',''),(455,1,1,'Szukasz klasycznej, zabytkowej kinkiety zewnętrznej? Zatem ta Antigua jest dla Ciebie! Elegancki design w stylu vintage z witrażami naprawdę dodaje stylu drzwiom / wejściom.  Ten zewnętrzny kinkiet w kształcie wiszącej latarni ma wysokość 44,5 cm, głębokość 26 cm i szerokość 18 cm. Lampa ma dużą oprawkę E27 i jest dostarczana bez źródła światła, więc upewnij się, że nadal ją zamawiasz (maks. 100 Watt).  Aby wieczorem było przytulnie, możesz również przyciemnić tę lampę (ściemniacz nie jest dołączony). Uzupełnij swój ogród lub fasadę tym Antigui!','','latarnia-zewnetrzna-w-stylu-vintage-braz-antigua','Meta description-Inne','Meta keywords-Inne','Meta title-Inne','Latarnia zewnętrzna w stylu vintage brąz - Antigua','W magazynie','Dostępny','',''),(456,1,1,'Ta lampa zewnętrzna New Haven tworzy romantyczną atmosferę w całym ogrodzie lub na tarasie! Jest pięknie wykończony w kolorze antycznego