ampa posiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 36 cm\n\nOdległość od ściany: 22.5 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27.\n\nZalecamy użycie dekoracyjnej żarówki, która podkreśli charakter lampy.\n\nLampa Bussum wykreuje magiczny klimat wokół domu i ogrodu.','','rustykalny-kinkiet-zewnetrzny-czarny-ip44-bussum','Meta description-Oblongue, Podłużny','Meta keywords-Oblongue, Podłużny','Meta title-Oblongue, Podłużny','Rustykalny kinkiet zewnętrzny czarny IP44 - Bussum','W magazynie','Dostępny','',''),(461,1,1,'Nowoczesna lampa zewnętrzna w kolorze stali zakończona mlecznym kloszem.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 80 cm\n\nWymiary podstawy: 12.5 x 12.5 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nLampy z serii Malios emitują przyjemne, klimatyczne światło.\n\nSeria Malios idealnie sprawdzi się w Twoim ogrodzie!','','lampa-zewnetrzna-stal-80cm-malios','Meta description-Oblongue, Podłużny','Meta keywords-Oblongue, Podłużny','Meta title-Oblongue, Podłużny','Lampa zewnętrzna stal 80cm - Malios','W magazynie','Dostępny','',''),(462,1,1,'Lampę zewnętrzną Guardado wyróżnia unikatowy design i najwyższa jakość wykonania. \n\nKolekcja Guardado swoją konstrukcją nawiązuje do stylu retro. \n\nSzklany klosz sprawia, że emitowane światło rozprasza się w każdym kierunku. \n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy do 60W. \n\nWysokość: 126 cm\n\nŚrednica podstawy: 17 cm\n\nWysokość klosza: 30 cm\n\nŚredn