iet zewnętrzny Londen pięknie oświetli drzwi i elewację budynku o zmroku oraz stworzy przyjemną atmosferę, która sprzyja relaksowi na świeżym powietrzu.\n\nLampa posiada stopień ochrony IP23, który zapewnia bezpieczną pracę lampy w deszczu.\n\nWysokość: 34 cm\n\nOdległość od ściany: 18 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27.\n\nLampa Londen wykreuje magiczny klimat wokół domu i ogrodu.','','romantyczny-kinkiet-zewnetrzny-braz-londyn','Meta description-Kwadratowy, Sześcian','Meta keywords-Kwadratowy, Sześcian','Meta title-Kwadratowy, Sześcian','Romantyczny kinkiet zewnętrzny brąz - Londyn','W magazynie','Dostępny','',''),(466,1,1,'Ta wpuszczana lampa jest super ekonomiczna dzięki wbudowanemu oświetleniu LED (niewymienne LED). Ma długość i szerokość 7 cm. Można go łatwo podłączyć do 230 Volt. Zintegrowana dioda LED ma moc 60 lumenów i 3000 kelwinów. Przy 30 000 godzin świecenia źródło światła wytrzymuje długo! Stopień ochrony IP44 gwarantuje, że można go łatwo umieścić na zewnątrz i dlatego świetnie sprawdza się jako oświetlenie zewnętrzne w ogrodzie lub pod tarasem!','','lampa-led-do-wbudowania-ledlite-square-7','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Lampa LED do wbudowania LEDlite Square 7','W magazynie','Dostępny','',''),(467,1,1,'Nowoczesna lampa zewnętrzna. Trzon lampy wykonany został z aluminium pokrytego poliestrową powłoką proszkową i zakończony przezroczystym kloszem z tworzywa sztucznego. Denmark pięknie oświetli podjazd, taras, ścieżkę ogrodową lub krzewy i inne rośliny. \n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 50 cm\n\nWymiary podstawy: 12 x 12 cm\n\nWymiary lampy: 8.5 x 8.5 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 13W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nLampy z serii Denmark emitują przyjemne, klimatyczne światło.\n\nSeria Denmark idealnie sprawdzi się w Twoim ogrodzie!\n\n\nUwaga: Może tymczasowo występować zjawisko kondensacji pary wodnej. Jest to normalne i wszystkie lampy zewnętrzne zostały zaprojektowane, by radzić sobie z tym problemem. Kondensacja zazwyczaj ustępuje po pewnym czasie od jej włączenia.','','przemyslowa-zewnetrzna-lampa-stojaca-50-cm-rdzawobrazowa-ip44-denmark','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Przemysłowa zewnętrzna lampa stojąca 50 cm rdzawobrązowa IP44 - Denmark','W magazynie','Dostępny','',''),(468,1,1,'Nowoczesny kinkiet Baleno II wyróżnia unikatowy design i najwyższa jakość wykonania. \n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu. Oznacza to pokrótce, że lampa nadaje się również do użytku zewnętrznego.\n\nWysokość: 16 cm\n\nSzerokość: 7 cm\n\nOdległość od ściany: 9.2 cm\n\nKinkiet Baleno II jest gotowy do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 2 x 7W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Zalecamy użycie żarówki LED. Oprawa wyposażona jest w 2 gwinty na GU10. \n\nKinkiet Baleno II idealnie sprawdzi się do oświetlenia elewacji, tarasu, drzwi wejściowych czy garażu.','','nowoczesny-kinkiet-czarny-baleno-ii','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesny kinkiet czarny - Baleno II','W magazynie','Dostępny','',''),(469,1,1,'Piękne, wpuszczane w ziemię miejsce dobrej jakości z ciężką osłoną ze stali nierdzewnej. Ten punkt naziemny ma uchylne wnętrze, dzięki czemu światło może być skierowane z ziemi. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Lampa ma średnicę 13 cm. Wymiary montażowe tego spotu: średnica 12,6 cm i głębokość 14,5 cm. Punkt jest dostarczany z kablem o długości ok. 30 cm, który należy wodoszczelnie połączyć z przewodem uziemiającym. Miejsce można również przejechać (można przejechać samochodem). Uzupełniasz lampę o źródło światła GU10 o mocy maks. 50. To źródło światła można zamówić osobno. Delux jest bryzgoszczelna, dzięki czemu jest idealną lampą do użytku na zewnątrz.','','oprawa-do-wbudowania-stal-ip65-delux','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Oprawa do wbudowania stal IP65 - Delux','W magazynie','Dostępny','',''),(470,1,1,'Czy chciałbyś dodać więcej atmosfery na zewnątrz? Możesz to zrobić za pomocą kinkietu Dania. Ten czarny kinkiet wykonany jest z aluminium z plastikiem. To, co czyni go tak wyjątkowym, to fakt, że szkło ma efekt dymu. Tworzy to przytulną atmosferę. Kinkiet ma głębokość 1,1 cm, wysokość 16,5 cm i długość 8,3 cm. Płyta montażowa ma głębokość 3 cm, długość 6 cm i szerokość 6 cm. Uzupełniasz Danię o źródło światła z oprawą E27 (maks. 15 Watt). Nie zapomnij zamówić ich osobno. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza (brak w zestawie). Dzięki wartości IP IP44 kinkiet jest bryzgoszczelny. Dzięki temu doskonale sprawdza się w miejscach osłoniętych, takich jak przy drzwiach wejściowych lub pod zadaszeniem. Spraw, aby Twoje otoczenie było bezpieczne i klimatyczne dzięki kinkiecie Dania.','','nowoczesny-kinkiet-zewnetrzny-czarny-ip44-z-przydymionym-szklem-dania','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesny kinkiet zewnętrzny czarny IP44 z przydymionym szkłem - Dania','W magazynie','Dostępny','',''),(471,1,1,'Szukasz ładnej lampy wiszącej na zewnątrz? Ten jest idealny dla Ciebie! Idealnie pasuje do nowoczesnego otoczenia. Kiedy powiesisz kilka obok siebie na zewnętrznej ścianie, od razu stworzysz wieczorem przyjemną atmosferę. Jest to oświetlenie LED, dzięki czemu lampa wytrzymuje bardzo długo i jest energooszczędna. Ze względu na wartość IP 55, jest bryzgoszczelna i pyłoszczelna, więc z pewnością może wytrzymać, gdy pada deszcz! Lampa ma głębokość 11 cm, średnicę 9,5 cm i wysokość 25,5 cm. Lampa posiada zintegrowane źródło światła o mocy 6 W, 800 lumenów, 2700 Kelwinów i 25 000 godzin świecenia. Nadaj swojej fasadzie więcej atmosfery dzięki lampie ściennej Amelia!','','nowoczesny-kinkiet-zewnetrzny-szary-ip55-z-diodami-led-amelia','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesny kinkiet zewnętrzny szary IP55 z diodami LED - Amelia','W magazynie','Dostępny','',''),(472,1,1,'Chodźmy nowocześnie ze Stevem. Wykonany jest z tworzywa sztucznego i wykończony w czarnym kolorze. Steve ma długość i szerokość 30 cm oraz wysokość 2,5 cm. Płyta montażowa ma długość i szerokość 27,5 cm. Lampa posiada niewymienne oświetlenie LED. Dzięki strumieniowi świetlnemu 2700 kelwinów i 1000 lumenów jest to prawdziwa potęga i zapewnia jasne, funkcjonalne światło. Uwaga: nadaje się tylko w gabinecie, przedpokoju lub w biurze. Oświetlenie LED wytrzymuje średnio 30 000 godzin świecenia. Lampa jest ściemniana za pomocą 3-stopniowego ściemniacza. Oznacza to, że po jednokrotnym naciśnięciu własnego włącznika światła uzyskujesz 100% światła (światło funkcjonalne). Kiedy naciskasz ponownie, otrzymujesz 60% światła, a za trzecim razem 30% światła (oświetlenie nastrojowe). Idealny do tworzenia atmosfery w pomieszczeniu! Dzięki wartości IP IP44 nadaje się również do użytku w łazience (bryzgoszczelny). Steve wprowadza ponadczasowy akcent do Twojego domu!','','plafon-czarny-30cm-ip44-3-stopniowe-sciemnianie-led-2700k-steve','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Plafon czarny 30cm IP44 3-stopniowe ściemnianie LED 2700K - Steve','W magazynie','Dostępny','',''),(473,1,1,'Klasyczna pod względem wielkości latarnia z 3 lampami. Jest pięknie wykończony plastikiem w kolorze antycznego złota i słynnym romantycznym i klasycznym wzorem latarni! Charakteryzuje się całkowitą wysokością 216 cm i średnicą 51 cm. Uzupełniasz tę stolicę o 3 źródła światła E27 o maksymalnej mocy 15 W (uwaga: te źródła światła nie są dołączone do lampy). Kapitał kradnie show w Twoim ogrodzie! Dzięki wartości IP IP44 jest doskonale odporny na zachlapanie wodą! Chcesz jeszcze więcej zabawy? Następnie możesz również przyciemnić tę lampę za pomocą zewnętrznego ściemniacza (nie ma go w zestawie). Pięknie jest zobaczyć tę stolicę nawet przy zgaszonych światłach!','','klasyczna-latarnia-antyczne-zloto-3-swietlna-ip44-capital','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Klasyczna latarnia antyczne złoto 3-świetlna IP44 - Capital','W magazynie','Dostępny','',''),(474,1,1,'Nowoczesna lampa wisząca Jarra świetnie sprawdzi do oświetlenia podjazdu, tarasu, ścieżki ogrodowej lub krzewów i innych roślin. \n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nRegulowana wysokość w zakresie: 55.5-150 cm\n\nŚrednica klosza: 11.6 cm\n\nWysokość klosza: 22.6 cm\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy do 40W. \n\nZalecamy użycie dekoracyjnej żarówki, która dodatkowo podkreśli charakter lampy.\n\nSeria Jarra kreuje magiczną atmosferę, która sprzyja relaksowi na świeżym powietrzu!','','nowoczesna-zewnetrzna-lampa-wiszaca-czarna-ip44-jarra','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna zewnętrzna lampa wisząca czarna IP44 - Jarra','W magazynie','Dostępny','',''),(475,1,1,'Zestaw czterech plamek Garly do ogrodu. Są małe i dlatego idealnie nadają się do umieszczenia w ogrodzie! Są one dostarczane w komplecie z podstawą (średnica 10 cm) i szpilką, dzięki czemu możesz wybrać sposób zastosowania tego zestawu. Mimo niewielkich rozmiarów świetnie nadają się na przykład do oświetlenia drzewa w ogrodzie. Jest to pośrednie światło, które sprawia, że naprawdę wygodnie jest siedzieć wieczorem na zewnątrz!  Dzięki wartości IP IP68 jest wodoodporny, nawet pod wodą! Plamy są wyposażone we zintegrowany moduł LED (niewymienny) o mocy 3 W, 270 lumenów i 3000 kelwinów na plamkę.  Mają wysokość 7 cm i średnicę 2,4 cm. Artykuł jest dostarczany z przewodem i wtyczką. Kable diod LED to 2 x 2 metry i 2 x 3 metry. Kabel z wtyczką ma 1,5 metra.  Główkę plamki można regulować, dzięki czemu możesz skierować światło tam, gdzie chcesz. Nowoczesne i eleganckie miejsce w ogrodzie: oto Garly.','','zestaw-4-pinow-w-tym-led-ip68-garly','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Zestaw 4 pinów w tym LED IP68 - Garly','W magazynie','Dostępny','',''),(476,1,1,'Grafitowa lampa wisząca Kansas ma matowe wykończenie w ciemnoszarym i białym wnętrzu klosza. Styl rustykalny naprawdę dodaje stylu drzwiom / wejściom. Ma całkowitą wysokość 90 cm, którą można skrócić podczas instalacji dzięki wytrzymałemu ogniwu łańcucha. Wykonany jest z aluminium i szkła. Dzięki wartości IP IP44 jest bryzgoszczelny i chroniony przed kroplami deszczu.  Uzupełnij grafit Kansas o dowolne źródło światła, pasując do oprawy E27 (maks. 60 Watt). Źródło światła wygląda świetnie w tym przezroczystym szkle. Lampa jest również ściemnialna za pomocą zewnętrznego ściemniacza. Wybierz grafitową lampę wiszącą Kansas i nadaj swojemu tarasowi wiejski akcent.','','zewnetrzna-lampa-wiszaca-wiejska-antracyt-ip44-grafit-kansas','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Zewnętrzna lampa wisząca wiejska antracyt IP44 - grafit Kansas','W magazynie','Dostępny','',''),(477,1,1,'Ta lampa wisząca Amsterdam składa się z kwadratowej ramy ze szklanymi panelami po bokach. Tworzy to piękny efekt świetlny na tarasie. Wybierz źródło światła, które pasuje do oprawy E27 (maks. 60 W). Wybierz efektowny wariant! Lampę można również ściemniać za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Amsterdam jest wykonany ze stali nierdzewnej i ma wartość IP IP23: odporny na lekki deszcz. Zawieś go pod swoim tarasem lub pod dachem, aby stworzyć dodatkową atmosferę. Lampa ma wysokość 100 cm, długość i szerokość 21 cm. Idź na zabawę z naszym Amsterdamem!','','przemyslowa-lampa-wiszaca-zewnetrzna-czarna-amsterdam','Meta description-Kwadratowy, Sześcian','Meta keywords-Kwadratowy, Sześcian','Meta title-Kwadratowy, Sześcian','Przemysłowa lampa wisząca zewnętrzna czarna - Amsterdam','W magazynie','Dostępny','',''),(478,1,1,'Kolekcja kinkietów zewnętrznych Mira kreuje magiczną atmosferę, która sprzyja relaksowi na świeżym powietrzu.\n\nKinkiet Mira emituje światło nie tylko do przodu, ale góra-dół.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu. \n\nWysokość: 19 cm\n\nOdległość od ściany: 10 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nPonadto, kinkiet Mira wyposażony został w czujnik zmierzchu, co oznacza, że automatycznie włącza się po zapadnięciu zmierzchu i wyłącza kiedy robi się widno.\n\nKinkiet Mira świetnie sprawdzi się jako oświetlenie elewacji, balkonu czy tarasu.','','nowoczesny-kinkiet-zewnetrzny-stal-czujnik-zmierzchu-ip44-mira','Meta description-Kula','Meta keywords-Kula','Meta title-Kula','Nowoczesny kinkiet zewnętrzny stal czujnik zmierzchu IP44 - Mira','W magazynie','Dostępny','',''),(479,1,1,'Lampa minimalistyczna, ale jakże klimatyczna. Kinkiet Batt LED może być stosowany w wielu pomieszczeniach. Dzięki wartości IP 65 ten kinkiet może być używany w łazience, ale równie łatwo na zewnątrz. Najwyższej jakości lampa zewnętrzna wykonana z wysokiej jakości aluminium z poliestrową powłoką proszkową. Dzięki diodom LED „high power” lampa ta zapewnia dużo światła przy niskim zużyciu energii. Lampa ma głębokość 3 cm, wysokość 9 cm i szerokość 17,5 cm. Lampa posiada 2 źródła światła LED o mocy 6 W, 400 lumenów i 3000 kelwinów. Batt ma również średnią liczbę godzin spalania 30 000. Połączenie jakości, designu, oszczędności i strumienia świetlnego sprawia, że lampa ta nadaje się do wielu zastosowań, zarówno wewnątrz jak i na zewnątrz, więc jest idealna!','','kinkiet-zewnetrzny-antracyt-175cm-led-ip65-batt','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny antracyt 17.5cm LED IP65 - Batt','W magazynie','Dostępny','',''),(480,1,1,'Sneezy to idealna lampa do uzupełnienia Twojego nowoczesnego lub eleganckiego tarasu! Twój ogród również przyciągnie wzrok. Lampa świeci w dół, co daje ładny efekt świetlny na ziemi. Szary kolor lampy sprawia, że jest bardzo ponadczasowa. Lampa ma wysokość 70 cm, długość 12 cm i szerokość 10 cm. Lampa posiada zintegrowane źródło światła LED o mocy 7 Watt. Lampa nie jest ściemniana. Sneezy to prawdziwy atut Twojego ogrodu!','','nowoczesna-lampa-zewnetrzna-szara-70cm-sneezy','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesna lampa zewnętrzna szara 70cm - Sneezy','W magazynie','Dostępny','',''),(481,1,1,'Nowoczesny kinkiet zewnętrzny w kolorze czarnym. Kinkiet Miro pięknie oświetli elewację budynku oraz taras. \n\nEmituje piękne, nastrojowe światło.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 21.4 cm\n\nDługość: 17.6 cm\n\nGłębokość: 6.5 cm\n\nKinkiet Miro jest gotowy do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 10W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nPonadto, kinkiet Miro wyposażony został w czujnik ruchu. Lampa jest włączana automatycznie po wykryciu ruchu.\n\nSeria Miro idealnie sprawdzi się w Twoim ogrodzie!','','kinkiet-zewnetrzny-czarny-ip44-z-czujnikiem-ruchu-miro','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny czarny IP44 z czujnikiem ruchu - Miro','W magazynie','Dostępny','',''),(482,1,1,'Noutica to seria lamp w stylu marynistycznym. Kojarzy się z oświetleniem typowym dla statków lub nadmorskich domków.\n\nGrube szkło z widocznym żłobieniem sprawia, że emitowane światło jest przyjemne i nastrojowe, a przy tym jest niezwykle ozdobne.\n\nKinkiet posiada podwyższone IP44, co oznacza, że można zamontować go również w łazience bądź na zewnątrz budynku.\n\nOdległość od ściany: 10.5 cm\n\nWysokość: 23 cm\n\nKinkiet jest gotowy do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Kinkiet wyposażony jest w gwint na E27 o maksymalnym poborze mocy do 60W. \n\nKinkiet Noutica jest bardzo charakterystyczny i pasuje też do każdego wymiaru wnętrza.\n\nMożna go zamontować na ścianie jako kinkiet bądź na suficie jako plafon.','','kinkiet-plafon-okragly-mosiadz-ip44-noutica','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Kinkiet/ Plafon okrągły mosiądz IP44 - Noutica','W magazynie','Dostępny','',''),(483,1,1,'Schiedam to fajna zewnętrzna lampa ścienna, która wytrzyma deszcz. Lampa wykonana jest z czarnego aluminium i tworzywa sztucznego. Ma głębokość 18,5 cm, wysokość 32,5 cm i długość 14,3 cm. Płyta montażowa ma średnicę 11 cm i głębokość 2,5 cm. Uzupełniasz ten kinkiet zewnętrzny o źródło światła z oprawą E27 (maks. 40 W), które nadal musisz zamówić osobno. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza (brak w zestawie). W ten sposób sprawisz, że wieczorem na tarasie lub w ogrodzie będzie bardzo przytulnie! Ze względu na wartość IP IP44, kinkiet zewnętrzny jest bryzgoszczelny, idealny do drzwi wejściowych lub szopy ogrodowej. Każdy znajdzie w domu miejsce dla tego pięknego Schiedama.','','designerski-kinkiet-zewnetrzny-czarny-ip44-schiedam','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Designerski kinkiet zewnętrzny czarny IP44 - Schiedam','W magazynie','Dostępny','',''),(484,1,1,'Nowoczesną lampę Plater wyróżnia klasyczny design i najwyższa jakość wykonania. \n\nPosiada stopień ochrony IP65, który zapewnia całkowitą ochronę przed wnikaniem pyłu oraz ochronę przed strumieniem wody z dowolnego kierunku. Oznacza to pokrótce, że lampa nadaje się do użytku zewnętrznego. \n\nW komplecie z super wydajną diodą LED emitującą światło o barwie ciepło białej (2700K) na poziomie 1800 lumenów. To źródło światła posiada klasę energetyczną A++, co oznacza, że jest nie tylko energooszczędne, ale zapewnia profity i dla Twojego portfela i dla środowiska. \n\nLampa nie nadaje się do ściemniania. \n\nLampę Plater można zamontować do ściany bądź do sufitu. \n\nŚrednica: 27.8 x 27.8 cm\n\nWysokość: 5 cm\n\nPonadto, lampa wyposażona została w czujnik zmierzchu, który uruchamia się po zapadnięciu zmierzchu. \n\nPlater idealnie sprawdzi się do oświetlenia elewacji, tarasu, drzwi wejściowych czy garażu.','','nowoczesna-kwadratowa-lampa-zewnetrzna-led-czujnik-zmierzchu-plater','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Nowoczesna kwadratowa lampa zewnętrzna LED czujnik zmierzchu - Plater','W magazynie','Dostępny','',''),(485,1,1,'Nasza słynna Burza ma starszego brata! Wielofunkcyjny i przyjazny dla środowiska. Projektantka Femke Creemers z Caravanity zastosowała kultowy kształt lampy burzowej i przekształciła ją w lampę, która jest naprawdę odporna na burzę (wartość IP IP44). Jest to kultowa lampa zewnętrzna, którą można wykorzystać jako przyciągającą wzrok w ogrodzie lub pod tarasem.  Ta burza ma wysokość 110 cm i szerokość 75 cm. Podstawa ma średnicę 50 cm. Jest dostarczany z kablem o długości 4,8 metra: tak bardzo długo! Uzupełnij swoją burzę źródłem światła, które pasuje do oprawy E27. Uwaga: burzy nie można ściemniać. Oczywiście zawsze możesz wybrać źródło światła z efektem płomienia, aby uzyskać jeszcze więcej atmosfery.  Wybierz wyjątkowy efekt przyciągający wzrok w swoim ogrodzie dzięki Storm Extra Large!','','lampa-stojaca-biala-110-cm-ip44-storm-extra-large','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Lampa stojąca biała 110 cm IP44 - Storm Extra Large','W magazynie','Dostępny','',''),(486,1,1,'Oprawa dogruntowa Tribus to doskonały sposób na oświetlenie podjazdów, obiektów ogrodowych, kostki brukowej. \n\nPosiada stopień ochrony IP67, dzięki temu jest ona odporna na bardzo ciężkie warunki atmosferyczne takie jak śnieg czy deszcz.\n\nKlosz lampy najazdowej wykonany jest ze szkła hartowanego, który chroni oprawę przed najazdami pojazdów.\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w 3 gwinty na GU10, każdy o maksymalnym poborze mocy do 35W. \n\nŚrednica: 20 cm\n\nGłębokość: 22 cm\n\nOpraw dogruntowa Tribus idealnie sprawdzi się w Twoim ogrodzie!','','oprawa-dogruntowa-ip67-tribus','Meta description-Cylindryczny, Okrągły','Meta keywords-Cylindryczny, Okrągły','Meta title-Cylindryczny, Okrągły','Oprawa dogruntowa IP67 - Tribus','W magazynie','Dostępny','',''),(487,1,1,'Klasyczna pod względem wielkości latarnia z 3 lampami. Jest pięknie wykończony plastikiem w czarnym kolorze i dobrze znanym romantycznym i klasycznym wzornictwie latarni! Charakteryzuje się całkowitą wysokością 216 cm i średnicą 51 cm. Uzupełniasz tę stolicę o 3 źródła światła E27 o maksymalnej mocy 15 W (uwaga: te źródła światła nie są dołączone do lampy). Kapitał kradnie show w Twoim ogrodzie! Dzięki wartości IP IP44 jest doskonale odporny na zachlapanie wodą! Chcesz jeszcze więcej zabawy? Następnie możesz również przyciemnić tę lampę za pomocą zewnętrznego ściemniacza (nie ma go w zestawie). Pięknie jest zobaczyć tę stolicę nawet przy zgaszonych światłach!','','klasyczna-latarnia-czarna-3-swietlna-ip44-capital','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Klasyczna latarnia czarna 3-świetlna IP44 - Capital','W magazynie','Dostępny','',''),(488,1,1,'Charlois zamienia Twój dom w dom! Lampa sufitowa wykonana jest z czarnego aluminium z plastikiem. Ma 11,5 cm wysokości, 24 cm długości i 24 cm szerokości. Uzupełniasz Charlois dwoma źródłami światła z oprawą E27 (maks. 40 W), które nadal musisz zamówić osobno. Lampę można ściemniać za pomocą zewnętrznego ściemniacza, aby wieczorem była jeszcze bardziej przytulna. Ze względu na wartość IP IP44, lampa sufitowa nadaje się zarówno na taras, jak i do łazienki jako oświetlenie podstawowe. Krótko mówiąc, idealna lampa sufitowa w doskonałej cenie!','','industrialna-lampa-sufitowa-czarna-ip44-charlois','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Industrialna lampa sufitowa czarna IP44 - Charlois','W magazynie','Dostępny','',''),(489,1,1,'Nowoczesna i efektowna lampa. Zgadnij co? Może być również stosowany w łazience! Dzięki wartości IP44 jest bryzgoszczelny. Kto powiedział, że w łazience nie można używać pięknego oświetlenia? Yuma wykonana jest ze złotej stali ze szkłem. Ma średnicę 41 cm i wysokość 9,3 cm. Płyta montażowa ma również średnicę 41 cm i wysokość 2,8 cm. Dostarczana jest bez źródła światła, więc nie zapomnij zamówić źródła światła z oprawą E27 (maks. 40 W). Ta piękna lampa jest również ściemniana za pomocą zewnętrznego ściemniacza, co jest idealne, jeśli chcesz przełączać się między światłem funkcjonalnym a nastrojowym. Odpicuj swoją łazienkę lampą Yuma!','','nowoczesna-lampa-sufitowa-zlota-41-cm-ip44-yuma','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Nowoczesna lampa sufitowa złota 41 cm IP44 - Yuma','W magazynie','Dostępny','',''),(490,1,1,'Sneezy to idealna lampa do uzupełnienia Twojego nowoczesnego lub eleganckiego tarasu! Twój ogród również przyciągnie wzrok. Lampa świeci w dół, co daje ładny efekt świetlny na ziemi. Szary kolor lampy sprawia, że jest bardzo ponadczasowa. Lampa ma wysokość 40 cm, długość 15 cm i szerokość 15 cm. Lampa posiada zintegrowane źródło światła LED o mocy 7 Watt. Lampa nie jest ściemniana. Sneezy to pra