nie','Dostępny','',''),(493,1,1,'Wybierz industrialny wygląd swojego ogrodu dzięki zewnętrznej lampie sufitowej Rotterdam. Ta lampa sufitowa jest wyposażona w źródło światła E27 w postaci ST64 o mocy 7 W i 15 000 godzin świecenia. Przydatną cechą dołączonego źródła światła jest to, że można nim łatwo sterować za pomocą aplikacji na smartfonie, Google Home lub Alexa. Źródło światła ma łącznie 806 lumenów i można je ustawić w zakresie od 1800 do 3600 kelwinów. Zapewnia to idealną intensywność i kolor światła, jakiego zawsze potrzebujesz. Rotterdam jest wykonany ze stali nierdzewnej i ma wartość IP IP23: dzięki temu jest odporny na wilgoć, ale nie na bezpośredni deszcz! Ta lampa sufitowa pięknie wisi pod baldachimem lub w ogrodzie Twojej altanki! Lampa ma długość 16 cm, wysokość 22,5 cm i szerokość 16 cm. Postaw na doskonały nastrój lub oświetlenie robocze dzięki lampie sufitowej Rotterdam na zewnątrz!','','przemyslowa-inteligentna-lampa-sufitowa-zewnetrzna-czarna-w-tym-st64-wifi-rotterdam','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Przemysłowa inteligentna lampa sufitowa zewnętrzna czarna, w tym ST64 Wifi - Rotterdam','W magazynie','Dostępny','',''),(494,1,1,'Nowoczesna oprawa do wbudowania Simply świetnie sprawdzi się jako oświetlenie nowoczesnych i minimalistycznych wnętrz. \n\nOprawa posiada stopień ochrony IP65 dlatego można ją stosować w łazience i na zewnątrz.\n\nWymiary oprawy: 9 x 9 cm\n\nŚrednica otworu montażowego: 7 cm\n\nGłębokość: 5.5 cm\n\nOprawa Simply wyposażona została w zintegrowane źródło światła LED, które emituje światło o barwie ciepło białej (2700K) na poziomie 350 lumenów! Dioda ta uzyskała klasę energetyczną A++, co oznacza, że jest nie tylko energooszczędna, ale zapewnia profity i dla Twojego portfela i dla środowiska. \nWbudowany moduł LED gwarantuje 25 000 godzin świecenia.\n\nPonadto oprawa jest ściemnialna za pomocą włącznika w ścianie. Pierwsze włączenie - 100% mocy emitowanego światła, szybkie wyłączenie