chrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 35 cm\n\nŚrednica klosza: 10.2 cm\n\nWysokość klosza: 20.5 cm\n\nŚrednica płytki montażowej: 11 cm\n\nGłębokość: 16 cm\n\nKinkiet Gleam jest gotowy do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nZalecamy użycie dekoracyjnej żarówki, która podkreśli charakter lampy.\n\nPonadto, kinkiet Gleam wyposażony został w czujnik ruchu. Lampa jest włączana automatycznie po wykryciu ruchu.\n\nKolekcję Gleam cechuje oryginalny design, który sprawi, że Twój ogród odżyje!','','nowoczesny-kinkiet-zewnetrzny-czarny-ip44-z-czujnikiem-ruchu-gleam','Meta description-Cylindryczny, Okrągły','Meta keywords-Cylindryczny, Okrągły','Meta title-Cylindryczny, Okrągły','Nowoczesny kinkiet zewnętrzny czarny IP44 z czujnikiem ruchu - Gleam','W magazynie','Dostępny','',''),(504,1,1,'Nowoczesny plafon Jarra świetnie sprawdzi do oświetlenia tarasu lub balkonu.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 22.6 cm\n\nŚrednica płytki montażowej: 11.6 cm\n\nWysokość klosza: 18.6 cm\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27 o maksymalnym poborze mocy do 40W. \n\nZalecamy użycie dekoracyjnej żarówki, która dodatkowo podkreśli charakter lampy.\n\nSeria Jarra kreuje magiczną atmosferę, która sprzyja relaksowi na świeżym powietrzu!','','nowoczesny-plafon-zewnetrzny-czarny-226cm-ip44-jarra','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesny plafon zewnętrzny czarny 22.6cm IP44 - Jarra','W magazynie','Dostępny','',''),(505,1,1,'Czy chciałbyś dodać więcej atmosfery na zewnątrz? Możesz to zrobić za pomocą kinkietu Dania. Ten czarny kinkiet wykonany jest z aluminium z plastikiem. To, co czyni go tak wyjątkowym, to fakt, że szkło ma efekt dymu. Tworzy to przytulną atmosferę. Kinkiet ma głębokość 11,7 cm, wysokość 18,7 cm i długość 8,3 cm. Płyta montażowa ma głębokość 2,8 cm, długość 6 cm i szerokość 6 cm. Uzupełniasz Danię o źródło światła z oprawą E27 (maks. 15 Watt). Nie zapomnij zamówić ich osobno. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza (brak w zestawie). Dzięki wartości IP IP44 kinkiet jest bryzgoszczelny. Dzięki temu doskonale sprawdza się w miejscach osłoniętych, takich jak przy drzwiach wejściowych lub pod zadaszeniem. Dzięki wyłącznikowi zmierzchowemu oświetlenie włącza się natychmiast po wykryciu ruchu. W ten sposób nigdy nie zapomnisz włączyć lub wyłączyć lampy, bardzo przydatne! Spraw, aby Twoje otoczenie było bezpieczne i klimatyczne dzięki kinkiecie Dania.','','kinkiet-zewnetrzny-czarny-ip44-z-wylacznikiem-zmierzchowym-dania','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny czarny IP44 z wyłącznikiem zmierzchowym - Dania','W magazynie','Dostępny','',''),(506,1,1,'Ulo to ponadczasowe miejsce do wbudowania, które idealnie pasuje do salonu, sypialni czy jadalni. Ma średnicę 8,2 cm i wysokość 3 cm. Instalacja ma średnicę 6,8 cm i głębokość 3,1 cm. Plamka wykonana jest z tworzywa sztucznego o białym wyglądzie. Ulo jest dostarczany z niewymiennym oświetleniem LED (maks. 5 Watt). Ma wartość 2700 -27000 kelwinów i 330 lumenów, co czyni go prawdziwą potęgą! Średnio dioda LED wytrzymuje 25 000 godzin świecenia. Lampa wyposażona jest w 3-stopniowy ściemniacz, dzięki któremu można stworzyć dodatkowy klimat w pomieszczeniu. Po jednokrotnym naciśnięciu przełącznika uzyskasz 100% światła (pełne światło), po ponownym naciśnięciu uzyskasz 60% światła. Za trzecim razem otrzymujesz 30% światła (światło otoczenia). Spoty doskonale sprawdzają się jako oświetlenie podstawowe, a przy tak pięknym miejscu jak Ulo przyjemnie się na nie patrzy. Teraz w wyjątkowo przystępnej cenie w zestawie 5 sztuk!','','zestaw-5-x-