t Rotterdam doda Twojemu dachowi lub szopie ogrodowej jeszcze więcej. Elegancki i minimalistyczny design sprawia, że ta lampa ścienna się wyróżnia. Ten nowoczesny kinkiet składa się z prostokątnej ramy ze szklanymi panelami po bokach. Zapewnia to przyjemny efekt prasowania na ścianie. Dzięki zastosowaniu specjalnej żarówki, kinkiet Rotterdam przyciąga wzrok w Twoim ogrodzie! Dzięki wartości IP IP44 ta lampa zewnętrzna jest bryzgoszczelna. Łatwo jest również podłączyć do 230 woltów. Nie musisz już szukać kluczy do domu w ciemności. Rotterdam posiada czujnik ruchu i zareaguje na wykryte ruchy, włączając oświetlenie. Zasięg tej lampy to około 7 metrów. Lampa ma 32,5 cm wysokości, 16,5 cm szerokości i 10 cm głębokości. Wykonany z wysokiej jakości aluminium, ten nowoczesny i elegancki kinkiet Rotterdam jest z pewnością dodatkowym atutem Twojej elewacji.','','kinkiet-zewnetrzny-czarny-z-czujnikiem-ruchu-ip44-rotterdam-1','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny czarny z czujnikiem ruchu IP44 - Rotterdam 1','W magazynie','Dostępny','',''),(519,1,1,'Nowoczesny plafon Flat wyróżnia unikatowy design i najwyższa jakość wykonania. Pasuje do każdego typu wnętrza. \n\nPodwyższony stopień ochrony IP44 pozwala na jego bezpieczne użytkowanie również w łazience.\n\nPlafon Flat  wyposażony został w zintegrowane źródło światła LED, które emituje światło na poziomie 2800 lumenów! \nDioda ta uzyskała klasę energetyczną A, co oznacza, że jest nie tylko energooszczędna, ale zapewnia profity i dla Twojego portfela i dla środowiska. \n\nUżywając włącznika/wyłącznika może regulować temperaturę emitowanego światła: od ciepło białej (2700K) do chłodnej (5000K).\n\nWymiary plafonu: 45 x 45 cm\n\nWymiary płytki montażowej: 20 x 20 cm\n\nWysokość: 6 cm\n\nPlafon Flat świetnie sprawdzi się jako główne oświetlenie w salonie, kuchni czy przedpokoju.','','nowoczesny-plafon-kwadratowy-chrom-45cm-led-ip44-flat','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Nowoczesny plafon kwadratowy chrom 45cm LED IP44 - Flat','W magazynie','Dostępny','',''),(520,1,1,'Cóż za ładna, okrągła lampa Cederic! Subtelny, ale szykowny akcent w Twojej łazience. Cederic to stalowa lampa w kolorze złotym ze szkłem. Ma głębokość 11,7 cm i średnicę 10 cm. Płyta montażowa ma głębokość 4 cm i średnicę 10 cm. Zmieści się w nim źródło światła z oprawką G9 (maks. 28 watów). Musisz to zamówić osobno, ponieważ nie jest wliczone w cenę. Lampa ma wartość IP IP44. Oznacza to, że jest bryzgoszczelny i dlatego doskonale nadaje się do wilgotnych pomieszczeń. Jak łazienka! Można go również ściemniać za pomocą zewnętrznego ściemniacza (brak ściemniacza w zestawie). Szukasz subtelnego, a zarazem nowoczesnego kinkietu? W takim razie Cederic jest dla ciebie.','','nowoczesna-lampa-scienna-zlota-ip44-cederic','Meta description-Kula','Meta keywords-Kula','Meta title-Kula','Nowoczesna lampa ścienna złota IP44 - Cederic','W magazynie','Dostępny','',''),(521,1,1,'Idealne wpuszczane miejsce do oświetlania Twojej łazienki! Nadaj swojej łazience wyjątkowo nowoczesny wygląd dzięki temu czarnemu Xena Square. Ma całkowitą długość i szerokość 8 cm. Wycięcie w tym miejscu ma 6,5 cm i głębokość 12 cm. Spot jest wyposażony w sprężyny zaciskowe, dzięki czemu można go łatwo przymocować do sufitu. Uzupełnij swój Xena Square, kupując źródło światła pasujące do oprawy GU10 (maks. 50 W). Dzięki wartości IP IP44 jest bryzgoszczelny i można go idealnie umieścić w łazience jako funkcjonalne oświetlenie. Spot można również ściemniać za pomocą zewnętrznego ściemniacza, dzięki czemu możesz stworzyć przytulną atmosferę w swojej łazience! Teraz jeszcze taniej w zestawie 3 szt.','','zestaw-3-lazienkowych-opraw-typu-downlight-w-kolorze-czarnym-ip44-xena-square','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Zestaw 3 łazienkowych opraw typu downlight w kolorze czarnym IP44 - Xena Square','W magazynie','Dostępny','',''),(522,1,1,'Te nowoczesne oprawy wpuszczane świetnie prezentują się w eleganckim stylu. Szukasz zestawu wpuszczanych reflektorów punktowych? Wtedy Simply może być czymś dla Ciebie. Reflektory Simply wpuszczane są dostarczane w zestawie po 6 sztuk i są wykonane z białego plastiku. Plamy mają długość 9 cm, szerokość 9 cm i wysokość 4,8 cm. Wymiary montażowe mają średnicę 7 cm i głębokość 7 cm. Otrzymasz je wraz z (niewymiennym) źródłem światła LED. Plamka daje 350 lumenów światła. Można je przyciemniać w 3 krokach, dzięki czemu możesz wybrać, jak jasne ma być światło. Od bardziej nastrojowego oświetlenia po funkcjonalne światło. Źródła światła mają 2700 kelwinów, co daje dodatkowe ciepłe, białe światło. Dzięki wartości IP IP65 są bryzgoszczelne i dobrze znoszą strumienie wody. Szukasz kwadratowych, białych, wpuszczanych plamek? Wtedy po prostu jest rozwiązaniem!','','zestaw-6-wpuszczanych-reflektorow-bialych-z-dioda-led-3-stopniowego-sciemniania-ip65-simply','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Zestaw 6 wpuszczanych reflektorów białych z diodą LED 3-stopniowego ściemniania IP65 - Simply','W magazynie','Dostępny','',''),(523,1,1,'Brak opisu','','set-van-6-moderne-grondspot-staal-rvs-basic-round','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Set van 6 moderne grondspot staal RVS - Basic Round','W magazynie','Dostępny','',''),(524,1,1,'Nie ma nic ładniejszego niż dobra lampa zewnętrzna przy drzwiach wejściowych lub na szopie ogrodowej. Litt jest przykładem tak doskonałej lampy zewnętrznej w tych miejscach. Wykonany jest z aluminium z tworzywem sztucznym i wykończony jest w kolorze antracytowej szarości. Litt włącza się, gdy tylko wykryje ruch i wyłącza się automatycznie. Nie musisz się więc martwić, że lampa pali się całą noc, ma głębokość 13,4 cm, wysokość 19,8 cm i długość 8,4 cm. Płyta montażowa ma głębokość 2,5 cm, wysokość 7 cm i długość 7,4 cm. Litt posiada niewymienne oświetlenie LED, które ma strumień świetlny 440 lumenów i 2700 kelwinów. Dzięki temu oświetlenie doskonale nadaje się do użytku na zewnątrz. Dzięki wysokiej wartości IP IP54 kinkiet jest bryzgoszczelny i dlatego może wytrzymać ulewny deszcz. Spraw, aby Twoje otoczenie było bezpieczniejsze dzięki lampie ściennej Litt.','','kinkiet-zewnetrzny-szary-w-tym-led-ip54-z-czujnikiem-ruchu-litt','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Kinkiet zewnętrzny szary w tym LED IP54 z czujnikiem ruchu - Litt','W magazynie','Dostępny','',''),(525,1,1,'Noutica to seria lamp w stylu marynistycznym. Kojarzy się z oświetleniem typowym dla statków lub nadmorskich domków.\n\nGrube szkło z widocznym żłobieniem sprawia, że emitowane światło jest przyjemne i nastrojowe, a przy tym jest niezwykle ozdobne.\n\nKinkiet posiada podwyższone IP44, co oznacza, że można zamontować go również w łazience bądź na zewnątrz budynku.\n\nOdległość od ściany: 16 cm\n\nWysokość: 10.6 cm\n\nKinkiet jest gotowy do podłączenia do instalacji o napięciu 230V. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Kinkiet wyposażony jest w gwint na E27 o maksymalnym poborze mocy do 60W. \n\nKinkiet Noutica jest bardzo charakterystyczny i pasuje też do każdego wymiaru wnętrza.\n\nMożna go zamontować na ścianie jako kinkiet bądź na suficie jako plafon.','','kinkiet-plafon-owalny-czarny-ip44-noutica','Meta description-Owalny','Meta keywords-Owalny','Meta title-Owalny','Kinkiet/ Plafon owalny czarny IP44 - Noutica','W magazynie','Dostępny','',''),(526,1,1,'Klasyczna latarnia zewnętrzna, którą często widzisz w filmach! Nowy Orlean powraca z zemstą i jest całkowicie współczesny dzięki nostalgicznemu projektowi. Latarnia zewnętrzna wykonana jest ze stali nierdzewnej ze szkłem. Ma wysokość 220 cm, długość 60 cm i szerokość 20 cm. Nowy Orlean jest dostarczany bez źródeł światła. Dlatego upewnij się, że masz dwa źródła światła, każde z oprawą E27 (maks. 60 W). Latarnia zewnętrzna jest ściemniana za pomocą zewnętrznego ściemniacza, nie jest to uwzględnione. Ze względu na wysoką wartość IP IP44 latarnia nadaje się do użytku na zewnątrz. Nadaj swojemu ogrodowi klasyczny wygląd dzięki latarni zewnętrznej New Orleans!','','latarnia-zewnetrzna-czarna-220-cm-2-swietlna-ip44-nowy-orlean','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Latarnia zewnętrzna czarna 220 cm 2-świetlna IP44 - Nowy Orlean','W magazynie','Dostępny','',''),(527,1,1,'Piękna designerska lampa zewnętrzna na Twój taras. Dzięki wartości IP44 jest bryzgoszczelny i idealnie nadaje się do umieszczenia pod dachem, aby poczuć się jak w prawdziwym salonie - ale potem w ogrodzie. Wydobądź wnętrze z Mart Pua! Lampa podłogowa ma 170 cm wysokości, 73 cm długości i 46 cm szerokości. Źródło światła jest w komplecie, więc nie musisz zamawiać go osobno. Daje 180 lumenów światła i dlatego jest naprawdę przeznaczony do oświetlenia nastrojowego. Barwę światła można regulować dzięki funkcji RGBW. Wybierz czerwony, zielony, niebieski lub po prostu: ciepłą biel (3000 K). Lampę można ładować za pomocą dołączonego kabla USB.','','designerska-zewnetrzna-lampa-podlogowa-czarna-ip44-z-led-rgbw-mart-pua','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Designerska zewnętrzna lampa podłogowa czarna IP44 z LED RGBW - Mart Pua','W magazynie','Dostępny','',''),(528,1,1,'Klasyczna latarnia zewnętrzna, którą często widzisz w filmach! Nowy Orlean powraca z zemstą i jest całkowicie współczesny dzięki nostalgicznemu projektowi. Latarnia zewnętrzna wykonana jest ze stali nierdzewnej ze szkłem. Ma wysokość 220 cm i średnicę 56 cm. Nowy Orlean jest dostarczany bez źródeł światła. Dlatego upewnij się, że masz trzy źródła światła, każde z oprawą E27 (maks. 60 W). Latarnia zewnętrzna jest ściemniana za pomocą zewnętrznego ściemniacza, nie jest to uwzględnione. Ze względu na wysoką wartość IP IP44 latarnia nadaje się do użytku na zewnątrz. Nadaj swojemu ogrodowi klasyczny wygląd dzięki latarni zewnętrznej New Orleans!','','latarnia-zewnetrzna-czarna-220-cm-3-swietlna-ip44-nowy-orlean','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Latarnia zewnętrzna czarna 220 cm 3-świetlna IP44 - Nowy Orlean','W magazynie','Dostępny','',''),(529,1,1,'Kinkiet zewnętrzny Kansas pięknie oświetli drzwi i elewację budynku o zmroku oraz stworzy przyjemną atmosferę, która sprzyja relaksowi na świeżym powietrzu.\n\nLampa posiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 30.3 cm\n\nOdległość od ściany: 29.4 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27.\n\nZalecamy użycie dekoracyjnej żarówki, która podkreśli charakter lampy.\n\nLampa Kansas wykreuje magiczny klimat wokół domu i ogrodu.','','kinkiet-zewnetrzny-antracyt-ip44-grafit-kansas','Meta description-Kula, Okrągły','Meta keywords-Kula, Okrągły','Meta title-Kula, Okrągły','Kinkiet zewnętrzny antracyt IP44 grafit - Kansas','W magazynie','Dostępny','',''),(530,1,1,'Ta lampa ścienna Rotterdam składa się z kwadratowej ramy ze szklanymi panelami po bokach. Tworzy to przyjemny efekt prasowania na zewnętrznej ścianie. Dlatego ważne jest, aby wybrać piękne źródło światła, bo jest ono widoczne! Wybierz źródło światła, które pasuje do oprawy E27 (maks. 60 W). Lampę można również ściemniać za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu). Rotterdam jest wykonany ze stali nierdzewnej i ma wartość IP IP44: doskonale odporny na deszcz! Ten kinkiet pięknie wisi przy drzwiach wejściowych lub w ogrodzie Twojego letniego domku! Lampa ma długość 16 cm i wysokość 25,5 cm. Stwórz przytulną atmosferę w ogrodzie z Rotterdamem.','','industrialny-kinkiet-zewnetrzny-czarny-szklo-ip44-rotterdam-2','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Industrialny kinkiet zewnętrzny czarny szkło IP44 - Rotterdam 2','W magazynie','Dostępny','',''),(531,1,1,'Hurricane 1 to ładny kinkiet do drzwi wejściowych lub szopy ogrodowej. Dba nie tylko o to, aby światło świeciło w dół, ale także w górę i w twoją stronę. W ten sposób zawsze masz wystarczająco dużo światła w ciemności! Kinkiet wykonany jest ze stali nierdzewnej z tworzywem sztucznym i jest wykończony w kolorze czarnym. Ma głębokość 12,8 cm, wysokość 11 cm i długość 28,7 cm. Kompletujesz kinkiet ze źródłem światła z oprawą E27 (max. 40 W). Upewnij się, że zamawiasz je osobno. Lampę można ściemniać za pomocą zewnętrznego ściemniacza (brak w zestawie). Ze względu na wysoką wartość IP IP44, kinkiet nadaje się do użytku na zewnątrz i jest bryzgoszczelny. Hurricane 1 to idealna lampa ścienna, jeśli chcesz dodać stylu swojemu ogrodowi. Więc nie wahaj się ani chwili dłużej!','','nowoczesny-kinkiet-zewnetrzny-czarny-ip44-hurricane-1','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Nowoczesny kinkiet zewnętrzny czarny IP44 - Hurricane 1','W magazynie','Dostępny','',''),(532,1,1,'Łatwa i prosta żarówka to Ensign. Jest bardzo mały i dlatego idealnie nadaje się do umieszczenia w ogrodzie! Pomimo niewielkich rozmiarów doskonale nadaje się na przykład do oświetlenia drzewa w ogrodzie.  Dzięki wartości IP IP65 jest wodoodporny. Ta lampa jest wyposażona w niewymienny moduł LED 210 lumenów, 3000 kelwinów i 30 000 godzin świecenia. Dzięki temu nie musisz już zamawiać źródła światła, jest ono gotowe zabłysnąć w Twoim ogrodzie!  Plamka ma wysokość 11 cm. Szpilka uziemiająca ma długość 18 cm. Główkę plamki można regulować, dzięki czemu możesz skierować światło tam, gdzie chcesz. Podstawowe i eleganckie miejsce w ogrodzie: to miejsce na ziemi Ensign.','','lampa-punktowa-czarna-uchylna-w-tym-led-ip65-ensign','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Lampa punktowa czarna uchylna w tym LED IP65 - Ensign','W magazynie','Dostępny','',''),(533,1,1,'Jara to elegancki kinkiet, który doskonale sprawdzi się np. przy drzwiach wejściowych lub altanie ogrodowej. Ale ta lampa ścienna sprawdza się również w łazience: przy lustrze czuje się jak w domu! Lampa wykonana jest z czarnego aluminium z plastikiem i ma kształt walca. Jara ma całkowitą wysokość 27,8 cm i średnicę 8,2 cm. Uzupełniasz lampę o źródło światła LED z oprawą E27 (15 Watt). Lampa ma wartość IP IP44 i dlatego jest bryzgoszczelna. Lampa jest ściemniana za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Z łatwością znajdziesz miejsce na ten nowoczesny kinkiet wewnątrz lub na zewnątrz!','','nowoczesny-kinkiet-czarny-ip44-jara','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesny kinkiet czarny IP44 - Jara','W magazynie','Dostępny','',''),(534,1,1,'Zewnętrzny kinkiet Simon zapewnia bezpieczny ogród. Dzięki czujnikowi ruchu lampa włącza się automatycznie po wykryciu ruchu. W ten sposób nigdy nie zapomnisz włączyć oświetlenia zewnętrznego, bardzo przydatne! Simon jest wykonany ze stali i wykończony w kolorze antracytowej szarości. Ma głębokość 9,1 cm, wysokość 16 cm i długość 13 cm. Płyta montażowa ma głębokość 3,5 cm, wysokość 14 cm i długość 11 cm. Dioda LED jest zintegrowana z oprawą. Ma strumień świetlny 420 lumenów i 3000 kelwinów. Idealnie sprawdzi się przy drzwiach wejściowych lub w altanie ogrodowej. Średnio kinkiet zewnętrzny wytrzymuje około 25 000 godzin palenia. Dzięki wartości IP IP54 lampa jest bryzgoszczelna, więc może wytrzymać niewielki deszcz. Lampa jest również regulowana, dzięki czemu Ty decydujesz, gdzie świeci oświetlenie. Zdobądź teraz tego przydatnego Simona!','','kinkiet-zewnetrzny-szary-ip54-z-czujnikiem-ruchu-led-simon','Meta description-Kwadratowy, Okrągły','Meta keywords-Kwadratowy, Okrągły','Meta title-Kwadratowy, Okrągły','Kinkiet zewnętrzny szary IP54 z czujnikiem ruchu LED - Simon','W magazynie','Dostępny','',''),(535,1,1,'Nowoczesna lampa zewnętrzna Baleno pięknie oświetli podjazd, taras, ścieżkę ogrodową lub krzewy i inne rośliny. \n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 65 cm\n\nWymiary podstawy: 12 x 8 cm\n\nLampa Baleno jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 11W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na GU10. \n\nSeria Baleno idealnie sprawdzi się w Twoim ogrodzie!','','przemyslowa-lampa-stojaca-zewnetrzna-antracyt-65cm-ip44-baleno','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Przemysłowa lampa stojąca zewnętrzna antracyt 65cm IP44 - Baleno','W magazynie','Dostępny','',''),(536,1,1,'Zestaw 5 opraw dogruntowych Basic Square.\n\nOprawa dogruntowa Basic Square to doskonały sposób na oświetlenie podjazdów, obiektów ogrodowych, kostki brukowej. \n\nPosiada stopień ochrony IP65, dzięki temu jest ona odporna na bardzo ciężkie warunki atmosferyczne takie jak śnieg czy deszcz.\n\nKlosz lampy najazdowej wykonany jest ze szkła hartowanego, który chroni oprawę przed najazdami pojazdów.\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na GU10 o maksymalnym poborze mocy do 50W. \n\nWymiary: 10.5 x 10.5 cm\n\nGłębokość: 13 cm\n\nOpraw dogruntowa Basic Square idealnie sprawdzi się w Twoim ogrodzie!','','zestaw-5-x-oprawa-dogruntowa-105cm-ip65-basic-square','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Zestaw 5 x oprawa dogruntowa 10.5cm IP65 - Basic Square','W magazynie','Dostępny','',''),(537,1,1,'Gotowy na nowoczesne oświetlenie do swojego ogrodu? W takim razie Charlotte jest tym, czego szukasz. Ta stojąca lampa zewnętrzna działa na energię słoneczną, dzięki czemu panel słoneczny automatycznie ładuje lampę. Przyjazne dla środowiska! Lampa wykonana jest ze stali i wykończona w kolorze czarnym. Ma wysokość 40 cm, długość 13 cm i szerokość 13 cm. Lampa zewnętrzna posiada niewymienne oświetlenie LED. Ma strumień świetlny 70 lumenów i 2700 kelwinów. Lampa zapewnia w ten sposób nastrojowe i wyjątkowo ciepłe, białe światło. Charlotte ma wartość IP IP65 i dlatego jest bryzgoszczelna. Tak idealny na zewnątrz! Spraw, by w Twoim ogrodzie było przytulnie dzięki stojącej lampie zewnętrznej Charlotte.','','stojaca-lampa-zewnetrzna-czarna-ip65-w-tym-led-solarna-charlotte','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Stojąca lampa zewnętrzna czarna IP65 w tym LED solarna - Charlotte','W magazynie','Dostępny','',''),(538,1,1,'Ta lampa zewnętrzna New Haven tworzy romantyczną atmosferę w całym ogrodzie lub na tarasie! Jest pięknie wykończony w kolorze antycznego złota, szklane tafle i rozpoznawalny klasyczny wygląd! Lampa ma wysokość 84 cm i średnicę 17,1 cm. Dzięki wartości IP IP44 doskonale nadaje się do użytku jako lampa zewnętrzna, jest odporna na zachlapanie wodą. Uzupełnij tę romantyczną atrakcję o źródło światła E27 o maksymalnej mocy 15 W. Uwaga: nadal musisz zamówić osobno źródło światła, nie jest dołączone. Możesz uczynić ją jeszcze bardziej przytulną, ściemniając tę lampę wieczorem (ściemniacz nie jest dołączony). Przytulny dodatek na zewnątrz!','','zewnetrzna-lampa-wiszaca-antyczne-zloto-ip44-new-haven','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Zewnętrzna lampa wisząca antyczne złoto IP44 - New Haven','W magazynie','Dostępny','',''),(539,1,1,'Oprawa dogruntowa Basic Round to doskonały sposób na oświetlenie podjazdów, obiektów ogrodowych, kostki brukowej. \n\nPosiada stopień ochrony IP65, dzięki temu jest ona odporna na bardzo ciężkie warunki atmosferyczne takie jak śnieg czy deszcz.\n\nKlosz lampy najazdowej wykonany jest ze szkła hartowanego który chroni oprawę przed najazdami pojazdów.\n\nW komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na GU10 o maksymalnym poborze mocy do 50W. \n\nŚrednica: 10.5 cm\n\nGłębokość: 13 cm\n\nOpraw dogruntowa Basic Round idealnie sprawdzi się w Twoim ogrodzie!','','oprawa-dogruntowa-stal-ip65-basic-round','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Oprawa dogruntowa stal IP65 - Basic Round','W magazynie','Dostępny','',''),(540,1,1,'Solidna i prosta nowoczesna lampa zewnętrzna ze stali nierdzewnej, czyli Sfera. Kula idealnie pasuje do nowoczesnego środowiska. Plastikowy sferyczny klosz ma kolor biały, dzięki czemu światło jest pięknie rozprowadzane. Naprawdę przyciąga wzrok do ogrodu! Przy wartości IP IP44 woda rozbryzgowa jest zamknięta.  Czapka Sfery ma średnicę 25 cm. Słup ma wysokość 100 cm. Lampa ma dużą oprawkę E27 i jest dostarczana bez źródła światła, więc upewnij się, że nadal ją zamawiasz (maks. 60 Watt). Aby jeszcze bardziej cieszyć się wieczorem, lampa ta może być również ściemniana (ściemniacz nie jest dołączony).  Rozświetl swój ogród lub taras dzięki Sferze!','','nowoczesna-lampa-zewnetrzna-slup-stal-nierdzewna-100-cm-sfera','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Nowoczesna lampa zewnętrzna słup stal nierdzewna 100 cm - Sfera','W magazynie','Dostępny','',''),(541,1,1,'Rozświetl swój zadaszony taras z Maurice. Maurice to orientalna rattanowa lampa wisząca do użytku na zewnątrz. I zgadnij co: nie potrzebujesz podłączenia do zasilania! Możesz łatwo naładować magnetyczne źródło światła za pomocą dołączonego kabla ładującego. Dzięki klasie ochrony IP44 lampa jest bryzgoszczelna i idealnie nadaje się do użytku na zewnątrz. Za pomocą pilota możesz regulować światło i wybierać spośród różnych ustawień kolorów: czerwonego, zielonego, niebieskiego lub ciepłej bieli. Zobacz, który kolor najlepiej pasuje do atmosfery, której szukasz i przyciemnij go według własnych upodobań. Lampa ma wysokość 160 cm i średnicę 40 cm.','','zewnetrzna-lampa-wiszaca-rattanowa-ip44-w-tym-led-rgbw-do-wielokrotnego-ladowania-maurice','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Zewnętrzna lampa wisząca rattanowa IP44 w tym LED RGBW do wielokrotnego ładowania - Maurice','W magazynie','Dostępny','',''),(542,1,1,'Nadaj swojemu ogrodowi orientalną atmosferę dzięki tej bambusowej lampie wiszącej na zewnątrz. Oświetlenie LED RGB można ustawić na ciepłe białe, czerwone, zielone lub niebieskie światło. Łatwy w obsłudze za pomocą dołączonego pilota. Ma wysokość 36 cm i szerokość 42 cm. Do lampy dołączona jest (niewymienna) dioda LED, pilot do obsługi RGB oraz ściemniacz. Lampa wisząca jest bryzgoszczelna o wartości IP IP44. Lampa posiada zasilanie USB. Zawieś Maurice na swoim dachu i spraw, aby był wyjątkowo przytulny na swoim tarasie!','','zewnetrzna-lampa-wiszaca-bambusowa-ip44-ze-sciemniaczem-led-rgb-maurice','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Zewnętrzna lampa wisząca bambusowa IP44 ze ściemniaczem LED RGB - Maurice','W magazynie','Dostępny','',''),(543,1,1,'Lampa sufitowa Flavi przyciąga wzrok do Twojego sufitu! Stalowe wykończenie lampy naprawdę wyróżnia się na tle białej obudowy. Lampa ma wysokość 9 cm i średnicę 28 cm. Płyta montażowa ma wysokość 3,5 cm i średnicę 28 cm. Uzupełnij tę lampę sufitową o dwa źródła światła o maksymalnej mocy 15 W każde z oprawą E27. Więc sam określ jasność, jaką chcesz. To urządzenie można również ściemniać za pomocą zewnętrznego ściemniacza. Uwaga: źródła światła i ściemniacz nie są dołączone. Spraw, aby lampa sufitowa Flavi była idealnym oświetleniem funkcjonalnym, nastrojowym lub podstawowym oświetleniem w Twoim domu!','','klasyczna-lampa-sufitowa-stalowa-28-cm-flavi','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Klasyczna lampa sufitowa stalowa 28 cm - Flavi','W magazynie','Dostępny','',''),(544,1,1,'Czy lubisz vintage? W takim razie kinkiet zewnętrzny Herman jest dla Ciebie idealny. Jego klasyczny design wprowadzi do Twojego ogrodu klimat retro. Herman jest wykonany ze stali z aluminium i wykończony w kolorze rdzawobrązowym. Ma głębokość 38 cm, wysokość 45,5 cm i długość 30 cm. Płyta montażowa ma głębokość 4,5 cm i średnicę 11 cm. Zamów źródło światła z oprawą E27 (maks. 40 Watt) do tej lampy, aby ją uzupełnić. Dzięki wartości IP IP44 kinkiet jest bryzgoszczelny, idealny na przykład przy drzwiach wejściowych lub altanie ogrodowej. Herman można ściemniać za pomocą zewnętrznego ściemniacza, którego nie ma w zestawie. Dzięki czujnikowi ruchu lampa włącza się natychmiast po wykryciu ruchu. Idealny, dzięki czemu nigdy nie zapomnisz włączyć lub wyłączyć lampy. Uzupełnij swój vintage ogród z Hermanem.','','vintage-kinkiet-zewnetrzny-brazowy-czujnik-ruchu-ip44-herman','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Vintage kinkiet zewnętrzny brązowy czujnik ruchu IP44 - Herman','W magazynie','Dostępny','',''),(545,1,1,'Zewnętrzna lampa Doc będzie prawdziwym atutem w Twoim ogrodzie. Ta elegancka lampa stojąca jest pięknie wykończona w stali ze szklanym mlekiem. Ta lampa emituje piękne białe światło przez tę szklankę mleka.  Lampa ma średnicę 10 cm i wysokość 60 cm. Kończymy lampą ze źródłem światła z oprawką E27 (maks. 15 Watów), którą należy jeszcze zamówić osobno. Lampa jest ściemnialna za pomocą zewnętrznego ściemniacza (ściemniacz nie wchodzi w skład zestawu).  Rozświetl swój ogród dzięki lampie zewnętrznej Doc!','','nowoczesna-stojaca-lampa-zewnetrzna-stal-60-cm-ip44-doc','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesna stojąca lampa zewnętrzna stal 60 cm IP44 - Doc','W magazynie','Dostępny','',''),(546,1,1,'Ten 9-watowy Dualy ma elegancki wygląd, idealny do ścian zewnętrznych. Pięknie wykończone czernią i plastikiem, dzięki czemu efekt świetlny jest bardziej miękki. Ma wysokość 20 cm i długość 16 cm. Głębokość lampy to 5,3 cm. Przy średniej liczbie 30 000 godzin świecenia możesz cieszyć się tą lampą przez długi czas. Dualy działa na czujniku jasno-ciemno. Lampa włącza się, gdy robi się ciemno i gaśnie, gdy znowu robi się jasno. Lampa posiada zintegrowaną diodę LED o strumieniu świetlnym 3000 K i 500 lumenów. Zapewnia to ciepłe, białe światło. Uwaga: tej lampy nie można ściemniać i dlatego szczególnie nadaje się do funkcjonalnego oświetlenia na tarasie lub przy drzwiach wejściowych. Dzięki wartości IP IP44 naprawdę nadaje się jako oświetlenie zewnętrzne!','','kinkiet-zewnetrzny-czarny-ip44-led-z-czujnikiem-zmierzchu-dualy','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny czarny IP44 LED z czujnikiem zmierzchu - Dualy','W magazynie','Dostępny','',''),(547,1,1,'Brak opisu','','moderne-plafondlamp-messing-ip44-4-lichts-cederic','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Moderne plafondlamp messing IP44 4-lichts - Cederic','W magazynie','Dostępny','',''),(548,1,1,'Nowoczesna lampa zewnętrzna w kolorze ciemnoszarym zakończona mlecznym kloszem.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu.\n\nWysokość: 45 cm\n\nWymiary podstawy: 12.5 x 12.5 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 60W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na E27. \n\nPonadto, lampa ma wbudowane gniazdo elektryczne do którego można podłączyć inne lampy bądź kosiarkę.\n\nLampy z serii Malios emitują przyjemne, klimatyczne światło.\n\nSeria Malios idealnie sprawdzi się w Twoim ogrodzie!','','lampa-zewnetrzna-stal-45cm-z-gniazdem-ip44-malios','Meta description-Oblongue, Podłużny','Meta keywords-Oblongue, Podłużny','Meta title-Oblongue, Podłużny','Lampa zewnętrzna stal 45cm z gniazdem IP44 - Malios','W magazynie','Dostępny','',''),(549,1,1,'Brak opisu','','moderne-plafondlamp-zwart-ip44-4-lichts-cederic','Meta description-Oblongue','Meta keywords-Oblongue','Meta title-Oblongue','Moderne plafondlamp zwart IP44 4-lich