nany z aluminium z plastikiem i wykończony jest w kolorze antracytowej szarości. Ma głębokość 13,02 cm, wysokość 11,75 i długość 12,04 cm. Płyta montażowa ma głębokość 1 cm, długość 6,6 cm i szerokość 7,6 cm. Kinkiet ma zintegrowane oświetlenie LED i dlatego nie można go wymienić. Ma strumień świetlny 600 lumenów i 2700 kelwinów. Daje to lampie zewnętrznej dużo światła, dzięki czemu możesz łatwo włożyć klucz do dziurki od klucza, gdy jesteś przy drzwiach wejściowych. Dzięki wartości IP IP54 kinkiet jest bryzgoszczelny i może wytrzymać ulewny deszcz. Uzupełnij swój domek ogrodowy lub drzwi wejściowe kinkietem zewnętrznym Zane.','','kinkiet-zewnetrzny-szary-w-tym-led-ip54-z-czujnikiem-ruchu-zane','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny szary w tym LED IP54 z czujnikiem ruchu - Zane','W magazynie','Dostępny','',''),(566,1,1,'Znana wszystkim lampa sztormowa ma nowy, designerski wygląd. \n\nLampa Storm jest piękna, wielofunkcyjna i łatwa w użytkowaniu! \nMożesz być pewny, że dzięki tej lampie, każdy zwróci uwagę na Twój ogród bądź taras.\n \nLampa ma podwyższony stopień ochrony IP44, co oznacza, że można bezpiecznie użytkować go na zewnątrz.\n \nWysokość: 51 cm\n \nSzerokość: 36 cm\n \nŚrednica podstawy: 23 cm\n \nDługość przewodu z wtyczką: 480 cm\n \nTryb świecenia: Funkcjonalne białe światło (3000K) - Światło do czytania (2000K 100%) - Nastrojowe światło (2000K 50%) - Blask świec','','lampa-stojaca-biala-51-cm-ip44-storm-large','Meta description-Okrągły','Meta keywords-Okrągły','Meta title-Okrągły','Lampa stojąca biała 51 cm IP44 - Storm Large','W magazynie','Dostępny','',''),(567,1,1,'Prosty i ponadczasowy kinkiet Solo zapewni idealne podświetlenie elewacji budynku.\n\nPosiada stopień ochrony IP44, który zapewnia bezpieczną pracę lampy w deszczu i kurzu. \n\nWysokość: 15 cm\n\nOdległość od ściany: 10.7 cm\n\nLampa jest gotowa do podłączenia do instalacji o napięciu 230 V. Maksymalny pobór mocy wynosi 35W. W komplecie nie ma źródła światła. Takowe należy zakupić we własnym zakresie. Lampa wyposażona jest w gwint na GU10. \n\nPonadto, kinkiet Solo wyposażony został w czujnik ruchu. Lampa jest włączana automatycznie po wykryciu ruchu.\n\nSprawdź pozostałe lampy z rodziny Solo!','','kinkiet-zewnetrzny-stal-ip44-z-czujnikiem-ruchu-solo','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Kinkiet zewnętrzny stal IP44 z czujnikiem ruchu - Solo','W magazynie','Dostępny','',''),(568,1,1,'Przytulna lampa zewnętrzna, to Rullo. Ładnie wykończone na czarno ze stali nierdzewnej. Ładnie pasuje pod nowoczesny lub wiejski taras, tworząc przytulną atmosferę! Lampa ma wysokość 24,5 cm i średnicę 8,5 cm. Płyta montażowa do ściany ma wysokość 11,5 cm i długość 7 cm.  Uzupełniasz Rullo o źródło światła pasujące do oprawy E27 (maks. 15 Watt). Lampa jest również ściemnialna za pomocą zewnętrznego ściemniacza.  Uwaga: ta lampa ma wartość IP IP44, dzięki czemu jest bryzgoszczelna. Możesz więc zamontować go pod tarasem, aby stworzyć przytulną atmosferę podczas ciepłych letnich wieczorów!','','nowoczesny-kinkiet-zewnetrzny-czarny-rullo','Meta description-Cylindryczny','Meta keywords-Cylindryczny','Meta title-Cylindryczny','Nowoczesny kinkiet zewnętrzny czarny - Rullo','W magazynie','Dostępny','',''),(569,1,1,'Ta przemysłowa lampa zewnętrzna Rotterdam to elegancka lampa sufitowa. Składa się z kwadratowej ramy ze szklanymi panelami po bokach. Ponieważ dwie oprawy są umieszczone naprzeciw siebie, ta przemysłowa lampa zewnętrzna ma zabawny charakter. De Rotterdam doda trochę więcej do szopy, dachu lub ogrodu. Lampa ma długość i szerokość 28 cm oraz wysokość 10 cm. Rotterdam jest wyposażony w 2 źródła światła WiFi ST64. Można nimi sterować przez Wi-Fi za pomocą aplikacji na telefon, Google Home lub Alexa. Na przykład możesz dostosować intensywność światła do 806 lumenów, przyciemniając je. Możesz również samodzielnie określić temperaturę barwową (1800 - 3600 kelwinów), możesz przejść od bardzo ciepłego białego światła do neutralnego białego światła. Średnia żywotność lampy wynosi 15 000 godzin. Rotterdam jest wykonany ze stali nierdzewnej i ma wartość IP IP23: dzięki temu jest odporny na wilgoć, ale nie na bezpośredni deszcz! Ta lampa sufitowa pięknie wisi pod baldachimem lub w ogrodzie Twojej altanki!','','przemyslowa-inteligentna-lampa-sufitowa-zewnetrzna-czarna-w-tym-2-wifi-st64-rotterdam','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Przemysłowa inteligentna lampa sufitowa zewnętrzna czarna, w tym 2 WiFi ST64 - Rotterdam','W magazynie','Dostępny','',''),(570,1,1,'Kinkiet Rotterdam sprawi, że Twój dach lub szopka ogrodowa będzie trochę ekstra. Ta fajna lampa ścienna składa się z prostokątnej ramy ze szklanymi panelami po bokach. Tworzy to piękny efekt prasowania na Twojej ścianie.Dzięki zastosowaniu specjalnej żarówki kinkiet Rotterdam przyciąga wzrok w Twoim ogrodzie! Dzięki wartości IP IP44 ta lampa zewnętrzna jest bryzgoszczelna. Można go również łatwo podłączyć do 230 woltów. Poza tym ta lampa jest bardzo miła dla oka, jest również bardzo poręczna. Posiada czujnik światło-ciemność LUX (czujnik zmierzchu); lampa zewnętrzna włącza się, gdy robi się ciemno i gaśnie, gdy znowu robi się jasno. Super poręczny! Lampa ma 32,5 cm wysokości, 10 cm głębokości i 16,5 cm szerokości. Wykonany z wysokiej jakości aluminium, ten nowoczesny i elegancki kinkiet Rotterdam jest z pewnością atutem Twojej elewacji.','','kinkiet-zewnetrzny-czarny-z-czujnikiem-swiatla-i-ciemnosci-rotterdam-1','Meta description-Podłużny','Meta keywords-Podłużny','Meta title-Podłużny','Kinkiet zewnętrzny czarny z czujnikiem światła i ciemności - Rotterdam 1','W magazynie','Dostępny','',''),(571,1,1,'Ładna lampa zewnętrzna o wyjątkowym wykończeniu w kolorze antycznego złota, która nadaje klasyczny i romantyczny wygląd! Ten kinkiet kradnie widowisko przy drzwiach wejściowych lub na tarasie! Jest regulowany, więc możesz zdecydować się na montaż w dół lub w górę: super zabawa! Dzięki wartości IP IP44 jest doskonale odporny na zachlapanie wodą. Lampa ma wysokość 35 cm i głębokość 19,7 cm. Dzięki źródłu światła E27 o maksymalnej mocy 15 W uzupełniasz naszą stolicę i jest gotowa zabłysnąć w Twoim ogrodzie! Uwaga: źródło światła nie jest dołączone do tej lampy. Możesz go przyciemnić za pomocą zewnętrznego ściemniacza (brak w zestawie). W ten sposób sprawisz, że będzie wyjątkowo przytulny! Klasyczny rozmiar na zewnątrz: to jest nasz kinkiet Capital','','kinkiet-zewnetrzny-antyczne-zloto-regulowany-ip44-capital','Meta description-Kwadratowy','Meta keywords-Kwadratowy','Meta title-Kwadratowy','Kinkiet zewnętrzny antyczne złoto regulowany IP44 - Capital','W magazynie','Dostępny','','');
